INSERT INTO `comments` VALUES (1,134,1,'A','2017-03-06 16:13:04','2017-03-06 16:13:04'),(2,134,1,'荒川先生A','2017-03-06 19:18:29','2017-03-06 19:18:29'),(3,134,1,'荒川先生B：クリック音が固い','2017-03-06 19:19:02','2017-03-06 19:19:02'),(4,134,1,'荒川先生B:Ⅱ音の前のクリック音が高い、もう少し弱めるとよくなる','2017-03-06 19:19:40','2017-03-06 19:19:40'),(5,128,1,'荒川先生C\nオープニングスナップが小さいor2音との間が小さい、Ⅱ音とオープニングスナップが区別して聴かれるべき\n','2017-03-06 19:30:55','2017-03-06 19:30:55'),(6,129,1,'荒川先生A','2017-03-06 19:32:22','2017-03-06 19:32:22'),(7,130,1,'荒川先生A','2017-03-06 19:33:35','2017-03-06 19:33:35'),(8,127,1,'荒川先生A','2017-03-06 19:34:49','2017-03-06 19:34:49'),(9,126,1,'荒川先生A','2017-03-06 19:36:10','2017-03-06 19:36:10'),(10,125,1,'荒川先生\nランブルが小さい（ランブルは元々聴きにくい）、低音の音量を上げランブル音を聴き取りやすくする','2017-03-06 19:38:28','2017-03-06 19:38:28'),(11,124,1,'ランブルがほとんど聴き取れない、低音ランブルを入れる(波形にでていない）\n荒川先生C','2017-03-06 19:41:22','2017-03-06 19:41:22'),(12,123,1,'摩擦音小さい\nⅡ音分裂、吸気で伸びて呼気で分裂しない（Ⅱ音の固定性分裂はおかしい、ありえない）\n（肺高血圧があるならば、吸気で伸びて呼気分裂がなくなる）','2017-03-06 19:44:30','2017-03-06 19:44:30'),(13,123,1,'荒川先生D','2017-03-06 19:44:39','2017-03-06 19:44:39'),(14,122,1,'荒川先生A','2017-03-06 19:45:09','2017-03-06 19:45:09'),(15,121,1,'荒川先生B\nⅡ音がおおきい、Ⅱ音が明確に波形出過ぎている\nⅡが聴こえないくらい「ザー」という波形になるべき','2017-03-06 19:46:56','2017-03-06 19:46:56'),(16,120,1,'荒川先生B\nⅠ音とⅡ音が強すぎる、「ズ、シャー」という聴こえ方になるべき。特にⅠ音が強い。弱くする。','2017-03-06 19:50:51','2017-03-06 19:50:51'),(17,119,1,'荒川先生A\n心房細動があることをコメントに明記する。','2017-03-06 19:52:23','2017-03-06 19:52:23'),(18,118,1,'荒川先生B\n全体的に硬すぎるor強すぎる、周波数が高すぎる、明らかな人工音であることが分かる','2017-03-06 19:54:38','2017-03-06 19:54:38'),(19,116,1,'荒川先生C\nMRはもう少しソフトな音がナチュラル、この音は明らかな人工音\nASならこのような音でよいが、血液が漏れるため音的にはソフトになる。','2017-03-06 19:56:30','2017-03-06 19:56:30'),(20,117,1,'荒川先生A','2017-03-06 19:57:51','2017-03-06 19:57:51'),(21,115,1,'荒川先生B\nもう少し柔らかくすべき、Aに近いB','2017-03-06 19:59:23','2017-03-06 19:59:23'),(22,113,1,'大動脈弁狭窄の音であることを明記、少し硬い感じもある（柔らかくする）\n荒川先生B（Aに近いB）\n大動脈弁狭窄であるならⅠ音はもう少し大きくすべき','2017-03-06 20:01:57','2017-03-06 20:01:57'),(23,114,1,'波形図が違っている（最初が弱い紡錘形）\n音は良い\n荒川先生C','2017-03-06 20:04:18','2017-03-06 20:04:18'),(24,114,1,'機能性雑音は正常でも聴こえる、音は小さい','2017-03-06 20:04:53','2017-03-06 20:04:53'),(25,62,1,'荒川先生\n図が音と合っていない\nこの音はありえない音','2017-03-06 20:07:36','2017-03-06 20:07:36'),(26,62,1,'Dランク','2017-03-06 20:07:48','2017-03-06 20:07:48'),(27,77,1,'荒川先生C\nⅢ音はものすごく柔らかい、図でも硬い音が見える（波形が長くなるべき）、\nⅠ音が分裂している箇所を修正すべき、\n右脚ブロックがあるとⅠ音が割れる\nよってランクD','2017-03-06 20:10:49','2017-03-06 20:10:49'),(28,77,1,'Ⅲ音がはっきり聴こえる、心を澄まさないと聴こえない、低周波の音であるべき','2017-03-06 20:12:01','2017-03-06 20:12:01'),(29,64,1,'荒川先生A','2017-03-06 20:12:33','2017-03-06 20:12:33'),(30,64,1,'Ⅰ音が割れている感じがある、Bランクに近いA、Ⅰ音の割れを無くせばA','2017-03-06 20:13:45','2017-03-06 20:13:45'),(31,93,1,'荒川先生C\n音が固い、合成音は全て硬い、オープニングスナップも硬いもう少し柔らかく','2017-03-06 20:18:50','2017-03-06 20:18:50'),(32,92,1,'荒川先生B\n人工音のため硬い印象の音、柔らかく修正が必要','2017-03-06 20:20:19','2017-03-06 20:20:19'),(33,94,1,'荒川先生A','2017-03-06 20:20:59','2017-03-06 20:20:59'),(34,91,1,'荒川先生A\n少し硬い感じがある、インパクトが強い、周波数を落として柔らかくすとよくなる','2017-03-06 20:23:01','2017-03-06 20:23:01'),(35,90,1,'荒川先生D\n全般的に硬い、周波数を低くする\n典型的ではない、動脈管開存の場合はⅡ音の奇異性分裂をおこす、吸気時にⅡ音が伸びて呼気時に一致するのが普通だが、この場合は逆になる（吸気時に一致し、呼気時に分裂が明確になる）、肺高血圧がある場合は固定性分裂\n特徴がでていない','2017-03-06 20:26:34','2017-03-06 20:26:34'),(36,89,1,'荒川先生D\n収縮中期にクリック波形が出ているのがおかしい、心室中隔欠損ではクリックはでない','2017-03-06 20:28:50','2017-03-06 20:28:50'),(37,88,1,'荒川先生C\n波形図と音が合っていない、音が固いいかにも人工音の印象','2017-03-06 20:31:08','2017-03-06 20:31:08'),(38,86,1,'荒川先生B\n波形と音が合っていない、波形図を合わせればB\n','2017-03-06 20:32:29','2017-03-06 20:32:29'),(39,85,1,'荒川先生B\n図と音が合っていない、確認差し替え\n','2017-03-06 20:33:42','2017-03-06 20:33:42'),(40,84,1,'荒川先生C\n図と音が合っていない、再確認、\n全収縮期に聴こえる','2017-03-06 20:35:29','2017-03-06 20:35:29'),(41,83,1,'荒川先生C\nⅠ音が分裂して聴こえる、右脚ブロックがある例とすべき（生理的、無害性ではなく右脚ブロック）\nⅠ音の分裂が無ければここの分類に掲示することOK','2017-03-06 20:38:39','2017-03-06 20:38:39'),(42,82,1,'荒川先生\nⅣ-Ⅰ-Ⅱしか聴こえない、HRを遅くしたらⅢ音が聴こえるかもしれないが\nⅣ音が固すぎる（もっと低い音、一番問題の箇所）、Ⅲ音をもう少し明確（低い音）に見せること','2017-03-06 20:43:01','2017-03-06 20:43:01'),(43,82,1,'ランクC','2017-03-06 20:43:20','2017-03-06 20:43:20');
/*!40000 ALTER TABLE `comments` ENABLE KEYS */;
