DROP TABLE IF EXISTS `contacts`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `contacts` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `company_id` int(10) unsigned NOT NULL COMMENT '[FK] 企業',
  `auth` int(11) NOT NULL COMMENT '権限：0=販社、1=顧客、2=管理者、3=開発者 しばらく未使用',
  `role` int(11) NOT NULL DEFAULT 1 COMMENT '役割：0=営業、1=顧客、2=営業兼顧客',
  `name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '契約者名。個人の場合は個人名とする',
  `email` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '契約者メールアドレス',
  `tel` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '契約者電話番号。区切りの-付き',
  `zip` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '郵便番号',
  `address` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '住所',
  `department` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '所属・支店/営業所',
  `password` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'パスワード 管理者画面用。未使用',
  `yomi` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '契約者名のよみ',
  `memo` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '管理用メモ欄',
  `created_at` datetime NOT NULL COMMENT '作成日時',
  `updated_at` datetime NOT NULL COMMENT '更新日時',
  `deleted_at` datetime DEFAULT NULL COMMENT '削除日時：ソフトデリート NULL以外でdisplay:none;',
  PRIMARY KEY (`id`),
  KEY `company_id` (`company_id`),
  CONSTRAINT `contacts_ibfk_1` FOREIGN KEY (`company_id`) REFERENCES `companys` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=171 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
