:30:19',610),(148,'','心エコー問題','','【問題】この症例の心エコー図の説明としてふさわしいものはどれか。下記から選びなさい。','',0,2,'2020-06-04 16:21:22','2020-06-08 12:29:25',609),(149,'','S4聴き取り問題','','次の心音の説明として最もふさわしいものを選びなさい','',60,4,'2020-06-04 16:24:25','2020-06-04 16:48:43',495),(150,'','収縮期の時相問題','','次の心音を聴いて、最も適切なものを選びなさい。','',30,NULL,'2020-06-06 10:33:18','2020-06-06 10:41:27',491),(151,'','Exam（見本）１','','【問題】ベル型の聴診器は主として低周波数（60Hz以下）の心音や心雑音を聴くのに使用し、膜面型の聴診器は比較的高周波（400Hz前後）の1音や2音を聴くのに使用します。  さて次の心音は、ベル面型聴診器で聴いたときの心音ですが、聴診部位は心尖部でしょうか、それとも心基部でしょうか？どちらか選びなさい。','',30,NULL,'2020-06-08 11:48:50','2020-06-08 12:01:32',496),(152,'','Exam（見本）２','','【問題】聴診の姿勢には、坐位、仰臥位、左側臥位、水平位（肘膝位）、立位と蹲位（squatting）があります。  さて、次の音はどの姿勢で聴診するのが適切でしょうか？適切なものを選びなさい。','',30,NULL,'2020-06-08 11:50:18','2020-06-08 12:37:46',495),(153,'','Exam（見本）３','','【問題】仰臥位による聴診は、心基部の心音や心雑音を聴くのに良い体位です。  さて、次の心雑音は仰臥位で心基部（大動脈弁部位）を聴診したときの音です。この音の説明として最も適切なものを1つ選びなさい。','',30,NULL,'2020-06-08 11:51:31','2020-06-08 11:51:31',492),(154,'','Exam（見本）４','','【問題】聴診をするにあたって大切なことは、静かな部屋で、患者さんをリラックスさせ、自分も呼吸を止めて、まず1音2音の大きさの比較から始めます。  さて問題です。正常の場合心尖部では1音が2音より大きく、心基部では2音が1音より大きく聴かれますが、次の音は心尖部、心基部どちらの心音でしょうか？ただしいものを選びなさい。','',30,NULL,'2020-06-08 11:52:34','2020-06-08 12:02:13',499),(155,'','Exam（見本）５','','【問題】2音は大動脈弁閉鎖と肺動脈弁閉鎖の時相に一致して聴かれる音ですが、呼吸による分裂が聴かれます。これは吸気により全身からの右房への血流が増加するため、右室から駆出される血液量が増えることにより肺動脈弁の閉鎖が遅れることで起こります。呼気時には分裂は聴かれません。  さて、次の中で呼吸によるS2分裂はどれでしょうか？正しいものを選びなさい。','',60,NULL,'2020-06-08 11:54:29','2020-06-08 12:38:51',498),(159,'','test_gs_hiroshi01','','test','',0,NULL,'2020-06-09 11:37:57','2020-06-15 19:27:56',613),(160,'','test','','test','',0,NULL,'2020-06-19 12:24:19','2020-06-19 12:24:19',NULL),(161,'','62.2mb','','test','',0,NULL,'2020-06-19 12:25:08','2020-06-19 12:25:08',624),(162,'','64mb','','64mb','/img/quizzes/162.png',0,NULL,'2020-06-19 12:47:51','2020-06-19 12:47:51',NULL),(163,'','64mb','','64mbtest','/img/quizzes/163.png',0,NULL,'2020-06-19 12:51:36','2020-06-19 12:51:36',625),(164,'','testk','','testk','',0,NULL,'2020-06-23 18:01:32','202