--
-- Table structure for table `registers`
--

DROP TABLE IF EXISTS `registers`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `registers` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `account_id` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '発行アカウント[FKではない]',
  `contract_id` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '契約情報[FKではない]',
  `coupon_id` int(10) unsigned NOT NULL DEFAULT 0 COMMENT 'クーポン[非依存リレーションに近いのでFKではない]',
  `dealer_id` int(10) unsigned NOT NULL COMMENT '[FK]販社個人情報',
  `customer_id` int(10) unsigned NOT NULL COMMENT '[FK]顧客個人情報',
  `memo` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '管理用メモ欄',
  `user` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'ユーザID　→　メアドを集めるなら登録?',
  `password` varchar(60) COLLATE utf8_unicode_ci NOT NULL COMMENT 'パスワード hashで登録',
  `auth` int(11) NOT NULL COMMENT '重複：0=非許可、1=許可(当面は第一三共)',
  `usage_type` int(10) NOT NULL DEFAULT 0 COMMENT '0:購入 1:1年イヤーユース月払い 2:1年イヤーユース年払い 3:3年イヤーユース月払い 4:3年イヤーユース年払い 99:デモ',
  `add_way` int(10) NOT NULL DEFAULT 0 COMMENT '0:なし 1:電話 2:郵送 3:電話と郵送',
  `up_at` datetime NOT NULL COMMENT '予約日時',
  `created_at` datetime NOT NULL COMMENT '作成日時',
  `updated_at` datetime NOT NULL COMMENT '更新日時',
  `deleted_at` datetime DEFAULT NULL COMMENT '削除日時：ソフトデリート NULL以外でdisplay:none;',
  PRIMARY KEY (`id`),
  KEY `dealer_id` (`dealer_id`),
  KEY `customer_id` (`customer_id`),
  CONSTRAINT `registers_ibfk_1` FOREIGN KEY (`dealer_id`) REFERENCES `contacts` (`id`),
  CONSTRAINT `registers_ibfk_2` FOREIGN KEY (`customer_id`) REFERENCES `contacts` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=39 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

