INSERT INTO `stetho_sounds` VALUES (4,2,'/audio/stetho_sounds/4.mp3',0,'正常心音','Tracheal sounds',2,'心基部','Heart base',1,0,'1','1','Ⅰ音とⅡ音を聞き比べてみましょう','Let\'s compare the sound with the sound\r\nLet\'s compare the sound with the sound\r\nLet\'s compare the sound with the sound','','',0,0,0,'2017-01-29 18:14:10','2020-03-11 12:12:24','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(19,3,'/audio/stetho_sounds/19.mp3',0,NULL,'Tracheal breathing sounds',1,NULL,'neck',0,1,NULL,'－',NULL,'                                                                                                Tracheal breathing sounds / coarse sounds / volumes heard on the cervical trachea are inspiration <expiration, with a clear silence between inspiration and expiration / throat / # respiratory_bronchial_001\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','',NULL,2,0,NULL,'2017-02-18 00:21:05','2020-04-12 18:30:40','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(20,3,'/audio/stetho_sounds/20.mp3',0,NULL,'Holosystolic murmur',2,NULL,'M',1,0,NULL,'Mitral Regurgitation(MR)',NULL,'The first sound (S1) is obscured by the loud high frequency holosystolic or (pansystolic) murmur. / S3 with early diastolic  ventricular filling, introduces a brief early diastolic rumble. / Secondary change from acute rheumatic fever (about 10% in patients who experienced this disease)\r\n            ','',NULL,0,0,NULL,'2017-02-18 00:22:35','2020-04-09 19:48:33','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(21,3,'/audio/stetho_sounds/21.mp3',0,NULL,'Diastolic rumble, Presystolic murmur',2,NULL,'M',1,0,NULL,'Mitral Stenosis (MS)',NULL,'A loud S1 with respiratory split of S2 at P. / The loud S1 is due to the fibrous changes of the valve extension in a long period, during closure after the elevated LA pressure has kept the leaflets relatively wide apart.  / The loud S1 and OS(opening snap) means that the valve is still soften. /  Sever MS is reflected in an OS, about 0.05 sec. after IIa, and a prolonged diastolic rumble terminating in a loud S1. / You can hear S1＞S2 followed by loud OS(opening snap) at T. / Presystolic murmur and loud S1, S2, OS; and mid-diastolic rumbling murmur over M.(Residual form of rheumatic fever) / The relation of heart sound and murmur: S1＞S2-OS-R-S1 / Secondary change of acute rheumatic fever, atherosclerotic change of mitral valve.\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','',NULL,0,0,NULL,'2017-02-18 00:25:56','2020-04-09 19:50:22','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(22,3,'/audio/stetho_sounds/22.mp3',0,NULL,'Early-diastolic regurgitant murmur',2,NULL,'T',1,0,NULL,'Aortic regurgitation (AR)',NULL,'Systolic ejection murmur audible at A is due to increased diastolic volume of LV sent out into aorta./After this-systolic murmur at A, you can hear a high frequency early-diastolic regurgitant (decrescendo) murmur, which is consistent with AR./The murmur is loudest at T (mid left sternal border, but may be audible in other areas./ At the apex, S1 is diminished, and there is a low frequency apical rumbling diastolic murmur, which is either a Austin-Flint secondary to AR, or due to MR (mitral stenosis)./ Etiology of AR is considered; congenital bicuspid aortic valve,  endocarditis, trauma, atherosclerosis, rheumatic origin (rare)  and secondary change from AS.  \r\n            ','',NULL,0,0,NULL,'2017-02-18 00:27:33','2020-04-09 19:56:26','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(23,3,'/audio/stetho_sounds/23.mp3',0,NULL,'Continuous murmur',2,NULL,'P',1,0,NULL,'Patent ductus arteriosus(PDA)',NULL,'Remaining ductus between aorta and pulmonary artery existing after birth./ This murmur peaks at the time of S2 and is characteristic of a PDA. / Loud coarse systolic (crescendo) and diastolic (decrescendo) murmur is audible at P, sometimes extend to entire precordium. / Most other causes of continuous murmur shows earlier systolic peaking. /A venous hum shows louder diastolic murmur.','',NULL,0,0,NULL,'2017-02-18 00:29:26','2020-04-09 19:57:26','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(24,3,'/audio/stetho_sounds/24.mp3',0,'肺胞呼吸音','Alveolar breath sounds',1,'肺臓全域','Whole lung',0,1,'肺胞呼吸音','Alveolar breath sounds','肺胞呼吸音/心音あり/安静時の肺胞呼吸音は音が小さく音量は吸気＞呼気/呼気の方が音は低く聴取/大きめの呼吸をすると呼吸音は聴取しやすい/肺臓全域/#respiratory_murmur_002\r\n','Same child as 035. Recording at age 5 Pneumothorax is improving.\nNoise disappeared. The feeling of \"far and muffled\" disappeared.','','',2,0,0,'2017-02-18 00:30:44','2017-03-09 16:44:43','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(25,3,'/audio/stetho_sounds/25.mp3',0,NULL,'Korotkoff sounds 2',9,NULL,'Blood pressure exam',1,1,NULL,'Hypertension',NULL,'            A Korotkoff sounds are made in the blood stream when an artery in the upper arm is compressed with a cuff to block the artery, followed by decompression/ The 1st point is that the sound synchronized with the heartbeat begins to sounds (systolic blood pressure)/ phase perceived as noise with decompression (Phase 2), phase with louder sound (Phase 3), phase with steeply weaker sound (Phase 2), phase with deafness changed to point 5(diastolic blood pressure).            \r\n            ','',NULL,2,0,NULL,'2017-02-18 00:32:37','2020-04-09 20:03:27','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(26,3,'/audio/stetho_sounds/26.mp3',0,NULL,'Korotkoff sounds 1',9,NULL,'Blood pressure exam',1,1,NULL,'Hypertension',NULL,'A Korotkoff sounds are made in the blood stream when an artery in the upper arm is compressed with a cuff to block the artery, followed by decompression/ The 1st point is that the sound synchronized with the heartbeat begins to sounds (systolic blood pressure)/ phase perceived as noise with decompression (Phase 2), phase with louder sound (Phase 3), phase with steeply weaker sound (Phase 2), phase with deafness changed to point 5(diastolic blood pressure).            ','',NULL,2,0,NULL,'2017-02-18 00:34:00','2020-04-09 20:02:41','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(27,3,'/audio/stetho_sounds/27.mp3',0,NULL,'Guru sounds Normal3',3,NULL,'abdomen',1,1,NULL,'-',NULL,'Peristaltic sounds propagate throughout the abdomen, so 1 ~ 2 auscultation positions are sufficient / Normal: At least 5 times per minute,\r\n            ','',NULL,2,0,NULL,'2017-02-18 00:36:11','2020-04-09 20:05:33','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(28,3,'/audio/stetho_sounds/28.mp3',0,NULL,'Guru sounds Normal2',1,NULL,'abdomen',1,1,NULL,'-',NULL,'Decreased: 1 ~ 2 times per minute (Constipation, peritonitis, paralytic ileus, decreased bowel movement due to surgery), Loss: No crackles for 5 minutes (Functional ileus and peritonitis), High: Always heard (Infectious enteritis, diarrhea, intestinal obstruction).\r\n            ','',NULL,2,0,NULL,'2017-02-18 00:41:14','2020-04-09 20:06:27','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(29,3,'/audio/stetho_sounds/29.mp3',0,NULL,'Guru sounds Normal1',1,NULL,'abdomen',1,1,NULL,'-',NULL,'Peristaltic sounds propagate throughout the abdomen, so 1 ~ 2 auscultation positions are sufficient / Normal: At least 5 times per minute,\r\nDecreased: 1 ~ 2 times per minute (Constipation, peritonitis, paralytic ileus, decreased bowel movement due to surgery), Loss: No crackles for 5 minutes (Functional ileus and peritonitis), High: Always heard (Infectious enteritis, diarrhea, intestinal obstruction).\r\n            ','',NULL,3,0,NULL,'2017-02-18 00:43:37','2020-04-09 20:07:01','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(30,3,'/audio/stetho_sounds/30.mp3',0,NULL,'Guru sounds Metallic sounds',3,NULL,'abdomen',1,0,NULL,'Mechanical ileus',NULL,'Sounds produced when the intestinal lumen is obstructed by intussusception, volvulus, adhesions, intestinal hernias or tumors and the fluid moves through that area / the sound is high pitched and metallic.','',NULL,2,0,NULL,'2017-02-18 00:45:28','2020-04-09 20:08:21','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(31,3,'/audio/stetho_sounds/31.mp3',0,NULL,'Continuous murmur',2,NULL,'Pulmonary valve area',1,0,NULL,'Patent ductus arteriosus(PDA)',NULL,'PDA/ The pressure difference between the pulmonary artery and the aortic shunt generates a murmur/ Continuous murmur that occurs during both systole and diastole.            ','PDA',NULL,2,0,NULL,'2017-02-18 00:47:33','2020-04-09 20:09:24','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(32,3,'/audio/stetho_sounds/32.mp3',0,NULL,'Early diastolic murmur',2,NULL,'Tricuspid valve area',1,0,NULL,'Aortic regurgitation (AR)',NULL,'AR/ Systolic ejection murmur and decrescendo murmur from early diastole are heard, and in moderate case, diastolic rumble（Austin-Frint)  is heard at the mitral valve area.','AR',NULL,2,0,NULL,'2017-02-18 00:49:22','2020-04-09 20:09:59','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(33,3,'/audio/stetho_sounds/33.mp3',0,NULL,'Middle diastolic murmur',2,NULL,'Mitral valve area',1,0,NULL,'Mitral Stenosis (MS)',NULL,'MS/ Mid diastolic murmur (rumble)/ Following opening of the mitral valve (OS), turbulent blood flows from the left atrium into the left ventricle, generating rumbling sounds.            ','MS',NULL,2,0,NULL,'2017-02-18 00:51:20','2020-04-09 20:10:39','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(34,3,'/audio/stetho_sounds/34.mp3',0,NULL,'Holosystolic murmur',2,NULL,'Tricuspid valve area',1,0,NULL,'Tricuspid regurgitation(TR)',NULL,'TR/ Holosystolic murmur is heard in the left lower sternal border and increases in volume during inspiration（Rivelo Carvallo sign).            ','TR',NULL,2,0,NULL,'2017-02-18 00:53:29','2020-04-09 20:11:19','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(35,3,'/audio/stetho_sounds/35.mp3',0,NULL,'Holosystolic murmur',2,NULL,'Mitral valve area',1,0,NULL,'Mitral Regurgitation(MR)',NULL,'MR/ Holosystolic murmur begins with  S1 persists to S2.            ','MR',NULL,2,0,NULL,'2017-02-18 00:55:15','2020-04-09 20:12:02','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(36,3,'/audio/stetho_sounds/36.mp3',0,NULL,'Late systolic murmur',2,NULL,'Mitral valve area',1,0,NULL,'Mitral valve prolapse(MVP)',NULL,'MVP/ Crescendo murmur heard in late systole following a click in mid-systole/ and the murmur continues to S2.','MVP',NULL,2,0,NULL,'2017-02-18 00:56:54','2020-04-09 20:12:41','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(37,3,'/audio/stetho_sounds/37.mp3',0,NULL,'Middle systolic murmur２',2,NULL,'Aortic valve area',1,0,NULL,'Aortic stenosis(AS)',NULL,'AS/ Mid-systolic ejection murmur is heard just before S2.            ','AS',NULL,2,0,NULL,'2017-02-18 01:00:05','2020-04-09 20:13:22','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(38,3,'/audio/stetho_sounds/38.mp3',0,NULL,'Middle systolic murmur１',2,NULL,'Pulmonary valve area',1,0,NULL,'Atrial septal defect (ASD)',NULL,'ASD/ Middle systolic murmur (relative pulmonary stenosis) and fixed S2 split at the pulmonic valve area.            ','ASD',NULL,2,0,NULL,'2017-02-18 01:01:33','2020-04-09 20:14:09','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(39,3,'/audio/stetho_sounds/39.mp3',0,NULL,'Early systolic murmur',2,NULL,'Any heart auscultation area',1,1,NULL,'-',NULL,'Early systolic murmur/ Ejection murmur (functional murmur)/ Beginning early in systole and fading out in mid-systole / short and soft sounds.            ','Innocent murmur',NULL,2,0,NULL,'2017-02-18 01:03:03','2020-04-09 20:14:47','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(40,3,'/audio/stetho_sounds/40.mp3',0,'水泡音（coarse crackles）','Bubble sound (coarse crackles)',1,'肺野','Lung field',1,0,'大葉性肺炎','Lobar pneumonia','大葉性肺炎、粗い断続性ラ音、coarse crackle、水泡音/吸気時に聴取される粗い断続性ラ音/吸気後半に細かい断続性ラ音（fine crackle捻髪音）様のラ音も聴こえる/呼気相では気管支呼吸音化がある/#respiratory_coarsecrackles_004','Lobar pneumonia, coarse intermittent rales, coarse crackle, bubbling noise / coarse intermittent rales heard during inspiration / fine intermittent rales in the second half of inspiration (fine crackle crunch) also heard / expired Phase has bronchial breath sounds / # respiratory_coarsecrackles_004','','',2,0,0,'2017-02-18 01:04:22','2017-02-18 01:04:22','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(41,3,'/audio/stetho_sounds/41.mp3',0,'水泡音（coarse crackles）','Bubble sound (coarse crackles)',1,'肺野','Lung field',1,0,'急性肺水腫','Acute lung edema','急性肺水腫、粗い断続性ラ音、coarse crackle、水泡音/全相にわたり聴こえる粗い断続性ラ音/#respiratory_coarsecrackles_005\r\n','Acute pulmonary edema, coarse intermittent rales, coarse crackle, blistering sound / coarse intermittent rales heard over all phases / # respiratory_coarsecrackles_005','','',2,0,0,'2017-02-18 01:05:36','2017-07-03 18:04:23','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(42,3,'/audio/stetho_sounds/42.mp3',0,'水泡音（coarse crackles）','Bubble sound (coarse crackles)',1,'肺野','Lung field',1,0,'肺水腫治療経過','History of pulmonary edema treatment','肺水腫治療、利尿薬投与、断続性ラ音減少、coarse crackle、水泡音/肺水腫に対して利尿薬治療後のラ音/（#0021_coarse_crackle_01／respiratory_coarsecrackle_005と比較し）断続性ラ音は減少/#respiratory_coarsecrackles_006','Pulmonary edema treatment, diuretic administration, intermittent rales reduction, coarse crackle, blister noise / raise after diuretic treatment for pulmonary edema / (compared to # 0021_coarse_crackle_01 / respiratory_coarsecrackle_005) intermittent rales decreased / # respiratory_coarsecrackles_006','','',2,0,0,'2017-02-18 01:07:12','2017-02-18 01:07:12','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(43,3,'/audio/stetho_sounds/43.mp3',0,'水泡音（coarse crackles）','Bubble sound (coarse crackles)',1,'肺野','Lung field',1,0,'細菌性肺炎','Bacterial pneumonia','細菌性肺炎、断続性ラ音、coarse crackles、水泡音/吸気相に粗い断続性ラ音（coarse crackles水泡音）を聴取、呼気時にもラ音が聴取される場合もあり、吸気時にスクウォークが聴取される（coarsecrackles_squawk_001）/中等度改善時の吸気相の断続性ラ音で、断続性ラ音は残存（coarsecrackles_squawk_002）/退院軽快時はわずかにラ音が聴取される（coarsecrackles_007）/細菌性肺炎のケースでは粗い断続性ラ音（coarse crackles水泡音）が聴取される/非定型肺炎（マイコプラズマ肺炎、クラミジア肺炎、ウイルス性肺炎など）では細かい断続性ラ音（fine crackles炎髪音）が聴かれる/#respiratory_coarsecrackles_007','Bacterial pneumonia, intermittent rales, coarse crackles, blisters / coarse crackles in the inspiratory phase (coarse crackles blisters) are heard. Listened (coarsecrackles_squawk_001) / Intermittent rales in the inspiratory phase during moderate improvement, intermittent rales remain (coarsecrackles_squawk_002) / Slight rales are heard at discharge and relief (coarsecrackles_007) / bacterial pneumonia In the case of the above, coarse intermittent rales (coarse crackles blisters) are heard / In atypical pneumonia (mycoplasma pneumonia, chlamydia pneumonia, viral pneumonia, etc.), fine intermittent rales (fine crackles flame hairs) are heard / # respiratory_coarsecrackles_007','','',2,0,0,'2017-02-18 01:08:38','2017-02-18 01:08:38','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(44,3,'/audio/stetho_sounds/44.mp3',0,'水泡音（coarse crackles）','Bubble sound (coarse crackles)',1,'肺野','Lung field',1,0,'肺水腫','Pulmonary edema','肺水腫、断続性ラ音、coarse crackles、水泡音、呼気相の連続性ラ音/肺水腫/吸気相で粗い断続性ラ音（coarse crackles水泡音）が聴かれ、呼気相で連続性ラ音が気道浮腫により聴取される（coarsecrackles_008）/中等度改善時には、粗い断続性ラ音（coarse crackles水泡音）は減少、肺胞呼吸音の軽度気管支呼吸音化がみられる（coarsecrackles_009）/肺水腫改善後ラ音は消失（coarsecrackles_010）/#respiratory_coarsecrackles_008','Pulmonary edema, intermittent rales, coarse crackles, blisters, expiratory continuity rales / pulmonary edema / coarse intermittent rales in inspiratory phase (coarse crackles blisters), continuous expiratory rales Is heard due to airway edema (coarsecrackles_008) / moderate improvement, coarse intermittent rales (coarse crackles blister sounds) are reduced, and alveolar breathing sounds are slightly bronchial breathing sounds (coarsecrackles_009) / pulmonary edema improvement After sound disappears (coarsecrackles_010) / # respiratory_coarsecrackles_008','','',2,0,0,'2017-02-18 01:10:09','2017-02-18 01:10:09','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(45,3,'/audio/stetho_sounds/45.mp3',0,'水泡音（coarse crackles）','Bubble sound (coarse crackles)',1,'肺野','Lung field',1,0,'肺水腫','Pulmonary edema','肺水腫、断続性ラ音、coarse crackles、水泡音、呼気相の連続性ラ音/肺水腫/吸気相で粗い断続性ラ音（coarse crackles水泡音）が聴かれ、呼気相で連続性ラ音が気道浮腫により聴取される（_001）/中等度改善時には、粗い断続性ラ音（coarse crackles水泡音）は減少、肺胞呼吸音の軽度気管支呼吸音化がみられる（_002）/肺水腫改善後ラ音は消失（_003）/#respiratory_coarsecrackles_009','Pulmonary edema, intermittent rales, coarse crackles, blisters, expiratory continuity rales / pulmonary edema / coarse intermittent rales in inspiratory phase (coarse crackles blisters), continuous expiratory rales Is heard due to airway edema (_001) / moderate improvement, coarse intermittent rales (coarse crackles blistering sound) are reduced, and alveolar breathing sound is slightly bronchial breathing sounding (_002) / pulmonary edema improvement The rear sound disappears (_003) / # respiratory_coarsecrackles_009','','',2,0,0,'2017-02-18 01:11:16','2017-02-18 01:11:16','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(46,3,'/audio/stetho_sounds/46.mp3',0,'水泡音（coarse crackles）','Bubble sound (coarse crackles)',1,'肺野','Lung field',1,0,'肺水腫','Pulmonary edema','肺水腫、断続性ラ音、coarse crackles、水泡音、呼気相の連続性ラ音/肺水腫/吸気相で粗い断続性ラ音（coarse crackles水泡音）が聴かれ、呼気相で連続性ラ音が気道浮腫により聴取される（_001）/中等度改善時には、粗い断続性ラ音（coarse crackles水泡音）は減少、肺胞呼吸音の軽度気管支呼吸音化がみられる（_002）/肺水腫改善後ラ音は消失（_003）/#respiratory_coarsecrackles_010','Pulmonary edema, intermittent rales, coarse crackles, blisters, expiratory continuity r