ufficiency) .P2 elevation includes pulmonary hypertension, pulmonary artery base forward enlargement (atrial septal defect, pulmonary artery ectasia, pulmonary valve regurgitation) whether either of the components for the components of the there is a pathology of / ⅱ sound there is A2 and P2 are of either (or attenuated is enhanced ) / # Cardi_pulmonary_sound2_accell_001','','',2,0,0,'2017-02-18 17:49:02','2017-03-09 16:07:42','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(77,3,'/audio/stetho_sounds/77.mp3',0,'Ⅲ音（生理的Ⅲ音）','Sound (physiological sound)',2,'心尖部','Apex',0,1,'生理的Ⅲ音、若年健常者','Physiological sound, young healthy people','Ⅲ音（生理的Ⅲ音）/聴取部位心尖部/患者を左側臥位にし、心尖部にベル面をあてて聴くとよい(軽く密着させる)（おっかさん）/Ⅲ音には生理的Ⅲ音（physiologicalS3）と病的Ⅲ音（pathologicalS3）がある/生理的Ⅲ音は若年健常者に、病的Ⅲ音は左房圧上昇を伴う左室機能不全例で聴かれる/#cardi_physiological_sound3_001','Sound (physiological sound) / Apex of listening site / Place the patient in the left lateral position and place the bell surface on the apex to listen (lightly adhere) (Oka) / The sound is physiological sound ( There are physiological S3) and pathological sound (pathological S3) / Physical sound is heard in healthy young people, and pathological sound is heard in left ventricular dysfunction with increased left atrial pressure / # cardi_physiological_sound3_001','','',0,0,0,'2017-02-18 17:51:14','2017-03-09 15:46:30','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(78,3,'/audio/stetho_sounds/78.mp3',0,'Ⅲ音（病的Ⅲ音・ギャロップリズム）','Ⅲ  (pathological Ⅲ sound, garro prism)',2,'心尖部','Apex',0,0,'病的Ⅲ音・ギャロップリズム','Pathological sound, garro prism','Ⅲ音（病的Ⅲ音・ギャロップリズム）/聴取部位心尖部/うっ血性心不全例/Ⅰ音とⅡ音は心不全に伴う左室収縮速度と血圧の低下により小さく低音/このような3拍子のリズムをgallop rhythm（奔馬調律）という/#cardi_patholosical_sound3_001','Ⅲ sound (pathological Ⅲ sound / Galloprism) / listening site apex / congestive heart failure case / Ⅰ sound and Ⅱ sound are low bass due to lowering of left ventricular contraction speed and blood pressure due to heart failure / rhythm of such three beats Is called gallop rhythm (Benma rhythm) / # cardi_patholosical_sound3_001','','',2,0,0,'2017-02-18 17:53:41','2017-03-09 15:29:46','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(79,3,'/audio/stetho_sounds/79.mp3',0,'Ⅳ音','Sound',2,'心尖部','Apex',1,0,'肥大型心筋症','Hypertrophic cardiomyopathy','Ⅳ音（病的Ⅳ音）/聴取部位心尖部/肥大型心筋症など/Ⅳ音はⅠ音の直前に生じるためⅠ音にマスクされ聴取しづらいが逆に触知しやすい/聴診器を圧迫するとⅣ音は聴こえないため、Ⅰ音の分裂との鑑別に利用できる/#cardi_patholosical_sound4_001','Ⅳ sound (pathological Ⅳ sound) / listening part apex / hypertrophic cardiomyopathy / Ⅳ sound occurs immediately before Ⅰ sound, so it is masked by Ⅰ sound, making it difficult to hear but conversely easy to touch / stethoscope compression Then you can not hear the sound, so you can use it to distinguish it from the sound split / # cardi_patholosical_sound4_001','','',2,0,0,'2017-02-18 17:55:02','2017-02-18 17:55:02','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(80,3,'/audio/stetho_sounds/80.mp3',0,'重合奔馬調律（ギャロップリズム）','Overlapping horse tuning (Gallo Prism)',2,'心尖部','Apex',1,0,'左室機能不全の拡張型心筋症','Dilated cardiomyopathy with left ventricular dysfunction','重合奔馬調律（ギャロップリズム）/聴取部位心尖部/左室機能不全の拡張型心筋症例など/Ⅲ音とⅣ音が重なり3拍子で聴こえる/拡張期が短いためにⅢ音とⅣ音が重合して聴こえる/PQ延長を伴う例で聴かれやすい/#cardi_summation_gallop_001','Overlapping horse rhythm (Galloprism) / Apical listening site / Dilated cardiomyopathy with left ventricular dysfunction / な ど sound and sound overlap and can be heard in 3 beats / Ⅲ sound and sound overlap due to short diastolic period Can be heard / easy to hear in examples with PQ extension / # cardi_summation_gallop_001','','',2,0,0,'2017-02-18 17:56:45','2017-02-18 17:56:45','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(81,3,'/audio/stetho_sounds/81.mp3',0,'重合奔馬調律（ギャロップリズム）','Overlapping horse tuning (Gallo Prism)',2,'心尖部','Apex',1,0,'拡張型心筋症','Dilated cardiomyopathy','重合奔馬調律（ギャロップリズム）/ 左室機能不全の拡張型心筋症例など/ 拡張期が短いためにⅢ音とⅣ音が重合して、3拍子で聴こえる/ PQ延長を伴う例で聴かれやすい/ #cardi_summation_gallop_002\r\n','Overlapping horse rhythm (Galloprism) / Dilated myocardial cases with left ventricular dysfunction / Due to the short diastole, the Ⅲ sound and Ⅳ sound are superimposed and can be heard in 3 beats / Easy to hear in cases with PQ prolongation / # cardi_summation_gallop_002','','',2,0,0,'2017-02-18 17:59:38','2017-07-03 18:03:22','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(82,3,'/audio/stetho_sounds/82.mp3',0,'四部調律','Four-part tuning',2,'心臓全域','Whole heart',1,1,'拡張型心筋症、心室瘤を伴う心筋梗塞など重篤な症例','Serious cases such as dilated cardiomyopathy and myocardial infarction with ventricular aneurysm','四部調律/聴取部位心臓全域/拡張型心筋症、心室瘤を伴う心筋梗塞など重篤な症例で聴取される/Ⅲ音とⅣ音が分かれた4拍子のリズムで聴かれる/#cardi_quarter_tuning_001','Quarter rhythm / Auditory site whole heart / Listened in severe cases such as dilated cardiomyopathy and myocardial infarction with ventricular aneurysm / Listened in quadruple rhythm with Ⅲ sound and Ⅳ sound separated / # cardi_quarter_tuning_001','','',1,0,0,'2017-02-18 18:01:09','2017-03-06 20:43:23','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(83,3,'/audio/stetho_sounds/83.mp3',0,'無害性生理的雑音','Harmless physiological noise',2,'心尖部','Apex',1,1,'若年者の無害性雑音','Harmless noise of young people','無害性生理的雑音/聴取部位心尖部/若年者の無害性雑音/駆出音は、大動脈弁狭窄や肺動脈弁狭窄で収縮期雑音の直前に発する小さな音/弁狭窄と下弁狭窄を鑑別する場合に、弁狭窄では駆出音を伴うが、下弁狭窄では駆出音を伴わない/#cardi_aortic_ejection_001','Harmless physiologic murmur / listening apex / harmless murmur / ejection sound of young person distinguishes small sound / valvular stenosis from lower valve stenosis just before systolic murmur in aortic or pulmonary stenosis In some cases, ejection sound is accompanied by valve stenosis, but ejection sound is not accompanied by lower valve stenosis / # cardi_aortic_ejection_001','','',1,0,0,'2017-02-18 18:02:39','2017-03-06 20:38:41','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(84,3,'/audio/stetho_sounds/84.mp3',0,'肺動脈駆出音','Pulmonary artery ejection sound',2,'肺動脈領域','Pulmonary