2（音圧変化あり）/cf:#cardi_tricuspid_regurgitation_001（音圧変化なし）\r\n','Total systolic murmur / tricuspid regurgitation Pulmonary hypertension / murmur increased during inspiration, decreased during expiration (Rivero Carvallo sign) / 4th intercostal sternum left border / # cardi_tricuspid_regurgitation_003 (with breathing sound) / cf: # cardi_tricuspid_regurgitation_002 (with sound pressure change) / cf: # cardi_tricuspid_regurgitation_001 (without sound pressure change)\n','','',1,0,0,'2017-03-05 18:27:46','2017-03-09 16:27:23','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(134,3,'/audio/stetho_sounds/134.mp3',0,'収縮中期クリック','Mid systolic click\n',2,'心尖部','Apex',1,0,'僧房弁逸脱（mitral　regurgitation）','Mitral regurgitation\n','収縮中期クリック/僧房弁逸脱（mitral　regurgitation）/クリックはⅠ音やⅡ音とは違うタイプの音（Ⅰ音とⅡ音の間に高調で短い特徴的な雑音）/聴取部位は心尖部/#cardi_mitral_regurgitation_002\r\n','Mid systolic click / mitral regurgitation / click is a different type of sound than the Ⅰ sound or Ⅱ sound (characteristic noise that is harmonic and short between Ⅰ and Ⅱ sounds) / listening point is apex / # cardi_mitral_regurgitation_002\n','','',1,0,0,'2017-03-05 18:32:47','2017-03-06 16:12:02','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(135,3,'/audio/stetho_sounds/135.mp3',0,'吸気時喘鳴stridor','Wheezing stridor during inspiration\n',1,'頸部','neck\n',1,0,'アナフィラキシー','Anaphylaxis\n','上気道が閉塞することにより生じる連続性ラ音／吸気時／咽頭、喉頭、上部気管などに生じる腫瘍や喀痰、異物またはアナフィラキシーが原因','Continuous rales due to obstruction of the upper respiratory tract / During inspiration / Tumor, sputum, foreign body or anaphylaxis in the pharynx, larynx, upper trachea, etc.\n','','',1,0,0,'2017-10-25 12:40:49','2018-12-31 02:24:58','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(136,2,'/audio/stetho_sounds/136.mp3',0,'類鼾音rhonchi','Rhonchi\n',1,'胸壁上／広範に伝搬','Above the parapet / widespread\n',1,0,'気管支喘息、COPD、慢性気管支炎、気管支拡張症、喀痰貯留など','Bronchial asthma, COPD, chronic bronchitis, bronchiectasis, sputum retention, etc.\n','気管支喘息やCOPDで生じる連続性ラ音／吸気時、呼気時／慢性的な炎症により内腔が荒れ狭窄するのが原因／痰などの分泌物により類鼾音（るいびおん）が聴かれることもある','Continuous buzzing sound caused by bronchial asthma or COPD / Inspiration, expiration / Chronic inflammation causes the lumen to be roughened and narrowed / Hearing sounds like sputum are heard by sputum and other secretions Also\n','','',2,0,0,'2017-10-25 12:47:29','2019-02-04 08:53:06','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(137,3,'/audio/stetho_sounds/137.mp3',0,'笛声音wheezes','Wheezes',1,'前胸部肺野／広範に伝搬','Precordial lung field / propagation widely\n',1,0,'気管支喘息、COPD、気管支狭窄','Bronchial asthma, COPD, bronchial stenosis\n','気管支喘息や慢性閉塞性肺疾患（COPD）では気道に炎症がおこります。気道の炎症は、気道を細くしたり痰を分泌したりします。\r\n治療には気道の炎症を防ぐ治療が行われます。','Bronchial asthma and chronic obstructive pulmonary disease (COPD) cause inflammation of the airways. Respiratory tract inflammation thins the airway and secretes sputum.\n','','',0,0,0,'2017-10-25 12:52:34','2018-12-31 02:24:09','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(138,3,'/audio/stetho_sounds/138.mp3',0,'気管呼吸音（正常）','Tracheal breathing sound (normal)\n',1,'頸部','neck\n',1,1,'－','－\n','気管呼吸音/大きく粗い音で高調な音の成分が多い/ 音量は吸気＜呼気/ 吸気と呼気の間にポーズ（休止期）がある','Tracheal breathing sound / Loud and coarse sound with many harmonic components / Volume is inspired <expiration / Pause (pause) between inspiration and expiration\n','提供　近畿大学医学部　髙階經和先生　です','Courtesy of Kinka University School of Medicine\n',0,0,0,'2017-10-25 12:59:26','2018-03-24 02:46:11','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(139,2,'/audio/stetho_sounds/139.mp3',0,'拡張中期雑音（拡張期ランブル・左室充満音）、僧帽弁開放音_001','Mid-diastolic noise (diastolic rumble, left ventricular filling sound), mitral valve opening sound _001\n',2,'心尖部','Apex\n',1,0,'僧房弁狭窄（mitral stenosis:MS）','Mitral stenosis (MS)\n','拡張中期雑音（拡張期ランブル・左室充満音）、僧帽弁開放音（OS）、Ⅰ音亢進/ 僧帽弁狭窄/ 狭窄により僧帽弁の開放が遅れ、拡張期（Ⅱ音とⅠ音の間：僧帽弁開放時期）に僧帽弁開放音（OS）を聴取/ それに引き続き拡張中期ランブル（左室充満音）を聴取/ 左側臥位にしてベル面で聴取/#cardi_mitral_stenosis_001','Mid-diastolic murmur (diastolic rumble, left ventricular filling sound), mitral valve opening sound (OS), hypertonia / mitral valve stenosis / stenosis delays mitral valve opening, diastolic (Ⅱ and Ⅰ sounds) During the period: listening to the mitral valve opening sound (OS) at the time of the mitral valve opening) / listening to the middle diastolic rumble (left ventricular filling sound) / listening to the bell face with the left lateral position / # cardi_mitral_stenosis_001\n','','',2,0,0,'2017-10-30 04:44:02','2019-02-04 08:53:13','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(140,2,'/audio/stetho_sounds/140.mp3',0,'正常心音_心尖部_002','Normal heart sound_apical part_002\n',2,'心尖部（Ⅰ音＞Ⅱ音）','Apical part (Ⅰ sound> Ⅱ sound)\n',1,1,'₋','₋','正常心音/ Ⅰ音はⅡ音より持続する低い音/ 次の音との間隔が短い方がⅠ音/ Ⅰ音とⅡ音の間に脈が触れる/ Ⅰ音の主振動は房室弁（僧帽弁・三尖弁）閉鎖時期（QRS波の後半部分）に一致して発生し、大動脈弁開放による振動がⅠ音の終末部分を構成/ Ⅱ音は半月弁（大動脈弁・肺動脈弁）の閉鎖時に血液が弁口を打つ振動/ 心尖部（TM領域）ではⅠ音＞Ⅱ音/ #cardi_normal_base_002','Normal heart sound / Ⅰ sound lasts longer than sound / lower sound / pulse between the next sound is shorter if the interval between sound is shorter // The main vibration of sound is atrioventricular valve Mitral valve / tricuspid valve) Occurrence coincides with the closing time (the latter half of the QRS wave), and the vibration caused by the opening of the aortic valve constitutes the terminal part of the / sound / の sound of the semi-lunar valve (aortic valve / pulmonary valve) Vibration when blood hits the orifice when closed / Sound at the apex (TM area)> Sound / # cardi_normal_base_002\n','','',2,0,0,'2017-10-30 04:45:26','2019-02-04 09:01:47','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(141,2,'/audio/stetho_sounds/141.mp3',0,'＃３６（１）クイズ用','# 36 (1) For quiz\n',1,'下肺野クイズ','Lower lung field quiz\n',1,0,'間質性肺炎クイズ','Interstitial pneumonia quiz\n','クイズ用＃３６（１）','# 36 for quiz (1)\n','','',2,0,0,'2017-11-14 23:35:55','2017-11-14 23:38:44','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(142,2,'/audio/stetho_sounds/142.mp3',0,'＃６４','# 64\n',2,'心尖部','Apex\n',1,1,'心臓クイズ','Heart quiz\n','心音クイズ用<br>＃６４','Heart sound quiz <br> # 64\n','','',2,0,0,'2017-11-14 23:36:46','2018-05-14 07:44:23','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(143,2,'/audio/stetho_sounds/143.mp3',0,'確認','Verification\n',1,'どっか','Somewhere',1,1,'知らんよ','I don\'t know\n','知らんがな','I do not know\n','provider Mr.Naoyuki Shimizu','provider Mr. Naoyuki Shimizu\n',0,0,0,'2018-03-16 02:26:26','2018-06-19 05:20:24','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(144,2,'/audio/stetho_sounds/144.mp3',0,'人工弁（機械弁）患者の心尖部心音','Apical heart sounds of artificial valve (mechanical valve) patients\n',2,'心尖部','Apex',0,0,'僧房弁閉鎖不全症','Mitral regurgitation\n','僧房弁閉鎖不全症では左心房と左心室の間にある僧帽弁の閉鎖機能が悪くなり収縮期に左心室から左心房に血液が逆流する/僧帽弁置換術では人工の機械弁またはウシやブタなどの生体弁を使う/機械弁は耐久性に優れるが抗凝固療法が必要/生体弁は耐久性に劣る/本症例は機械弁置換の症例 \r\n\r\n髙階經和先生プロフィール　<br>\r\n 近畿大学医学部循環器内科客員教授　<br>\r\n 公益社団法人臨床心臓病学教育研究会理事長 　<br>\r\n 髙階国際クリニック院長 　<br>\r\n 第63回日本心臓病学会　第1回教育貢献賞 　<br>\r\n 第48回日本医学教育学会　医学教育賞・日野原賞受賞<br>\r\n<a href=\"http://telemedica.sakura.ne.jp/VPA_KKZ_TOP_21case/physical/index.html\">リンク</a>','In mitral regurgitation, the mitral valve between the left atrium and left ventricle fails to function properly, and blood flows back from the left ventricle to the left atrium during systole. Use living valves such as pigs and pigs / Mechanical valves have excellent durability but anticoagulation therapy is required / Biological valves have poor durability / This case is a case of mechanical valve replacement\n','音源提供　髙階經和先生','Sound source provided by Dr. Kazuoka\n',2,0,0,'2018-03-24 02:44:39','2018-08-07 08:29:12','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(145,2,'/audio/stetho_sounds/145.mp3',0,'聴くゾウ疑似体験音（正常心音_心尖部_002を特殊加工）','Simulated elephant experience sound (special processing of normal heart sound _ apex _002)\n',2,'心尖部（Ⅰ音＞Ⅱ音）','Apical part (Ⅰ sound> Ⅱ sound)\n',1,1,'―','―\n','この音は、聴くゾウを疑似的に体験するための特殊音源です。イヤホンで聴いた時でも「聴くゾウ」で聴く音に近くなるように特別な技術を用いて加工しました。音源ソースは下段の「正常心音_心尖部_002」と同じです。イヤホンを使って「正常心音_心尖部_002」を聴いたときには、音が割れるようなノイズが聴かれます。「聴くゾウ疑似体験音」の音は音割れがありません※。このように「聴くゾウ」を使うと生体音と遜色がないリアルな音が再生されます。\r\n※イヤホンの性能により差があります。\r\n','This sound is a special sound source for simulating the elephant listening. Even when listening with earphones, it is processed using a special technology so that it is close to the sound heard with \"Listening Elephant\". The sound source is the same as \"Normal heart sound_apical_002\" at the bottom. When you listen to \"normal heart sound_apical part_002\" using earphones, you will hear noise that breaks the sound. The sound of \"Elephant listening experience sound\" has no sound cracking *. In this way, using \"Listening Elephant\" reproduces a realistic sound that is comparable to the body sound.\n','正常心音_心尖部_002を特殊加工','Special processing of normal heart sound_apical part_002\n',2,0,0,'2018-08-07 03:10:29','2019-02-04 08:53:37','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(146,2,'/audio/stetho_sounds/146.mp3',0,'正常心音_比較サンプル','Normal heart sound_Comparison sample\n',1,'心尖部','Apex\n',1,0,'―','―\n','サンプル','sample\n','','',2,0,0,'2018-08-07 08:30:52','2019-02-04 08:53:43','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(147,2,'/audio/stetho_sounds/147.wav',0,'胸膜摩擦音２：落選','Pleural Friction Sound 2: Lost\n',1,'肺野','Lung field\n',1,0,'胸膜炎','Pleurisy','胸腔鏡下肺切除後によく聞かれる','Often heard after thoracoscopic lung resection\n','','',2,0,0,'2019-02-04 09:01:01','2019-02-18 10:45:57','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(149,2,'/audio/stetho_sounds/149.wav',0,'胸膜摩擦音１：決定','Pleural friction sound 1: determined\n',1,'肺野','Lung field\n',1,0,'胸膜炎','Pleurisy','胸腔鏡下肺切除後によく聞かれる/ヘッドホンで聞くと呼気後にポーズあり','Frequently heard after thoracoscopic lung resection / Headphones pose after expiration\n','','',2