2019-04-28 06:20:06','2019-06-01 07:44:11','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(179,2,'/audio/stetho_sounds/179.wav',0,'コロトコフ音１','Korotkoff sound 1\n',9,'上腕','Upper arm',1,1,'高血圧','Hypertension','上腕の動脈をカフで圧迫して動脈を閉塞させた後、続いて減圧していくときに生じる血流でコロトコフ音が発生/心拍に同期した音が「トントン」と聴こえ始める点が第１点（収縮期血圧）/その後減圧に従い雑音としてとらえられる相（第２相）、音が大きくなる相（第３相）、急激に弱くなる相（第４相）、聴こえなくなる第５点へと変化（拡張期血圧）','\nThe first point is the point where the Korotkoff sound is generated by the blood flow that occurs when the artery of the upper arm is cuffed with a cuff to occlude the artery and then decompresses / the sound synchronized with the heartbeat starts to be heard (Systolic blood pressure) / After that, the phase changes to the phase that is perceived as noise (second phase), the loudest phase (third phase), the rapidly weakening phase (fourth phase), and the fifth point at which the sound cannot be heard according to the decompression. (Diastolic blood pressure)','','',1,0,0,'2019-04-28 06:21:05','2019-06-01 07:44:07','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(180,2,'/audio/stetho_sounds/180.wav',0,'グル音　正常３','Glue sound normal',3,'腹部','Abdomen',1,1,'―','','蠕動音は腹部全体を伝播するため聴診箇所は1〜2ヵ所で十分/ 正常：1分間に5回以上（5～15秒毎）グル音が聴こえる、 減少：1分間に1〜2回（便秘、腹膜炎、麻痺性イレウス、手術による腸運動低下）、 消失：5分間グル音が聴こえない（機能的イレウス、腹膜炎）、 亢進：常に聴こえる（感染性腸炎、下痢、腸閉塞）','\nPeristaltic sound propagates through the entire abdomen, so 1-2 auscultation points are sufficient / Normal: 5 or more times per minute (every 5 to 15 seconds), gurus can be heard, Decrease: 1 to 2 times per minute (constipation) , Peritonitis, paralytic ileus, bowel motility due to surgery), disappearance: 5 minutes of inaudible glue (functional ileus, peritonitis), enhanced: always audible (infectious enteritis, diarrhea, ileus)','','',1,0,0,'2019-04-28 06:22:01','2019-06-01 07:44:03','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(181,2,'/audio/stetho_sounds/181.wav',0,'グル音　正常２','Guru sound normal 2',3,'腹部',