 click sound <br> <br> Supervision Educational Study Group on Clinical Cardiology Chairman 髙 Prof.','MVP','MVP',1,0,0,'2019-04-28 06:44:16','2019-06-01 07:43:16','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(191,2,'/audio/stetho_sounds/191.mp3',0,'心雑音　収縮中期','Heart murmur 中 mid-systole\n',2,'心基部','Heart base',1,0,'大動脈弁狭窄（Aortic stenosis；AS）','Aortic stenosis (AS)','駆出性雑音がⅡ音の直前まで続く/ 駆出性雑音は大動脈弁・肺動脈弁付近に血流に対する抵抗があると、心室内と動脈内の圧差が生じることで発生<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','Ejective murmur lasts until just before the sound / Ejective murmur is caused by pressure difference between ventricle and intraarterial when there is resistance to blood flow near aortic valve / pulmonary valve <br> Clinical heart Education and Research Society 病 Chairman Kazuyoshi Fumi','AS','AS',1,0,0,'2019-04-28 06:45:06','2019-06-01 07:43:10','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(192,2,'/audio/stetho_sounds/192.mp3',0,'心雑音　収縮中期','Heart murmur 中 mid-systole',2,'肺動脈弁部位','Pulmonary valve site',1,0,'心房中隔欠損（Atrial septal defect :ASD）','Atrial septal defect (ASD)','肺動脈弁部位で収縮中期雑音（相対的肺動脈狭窄）とS2の固定性分裂\r\n<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','Mid-systolic murmur (relative pulmonary stenosis) and fixed splitting of S2 at the pulmonary valve site\n<br> Supervision Educational Study Group for Clinical Cardiology President','ASD','ASD',1,0,0,'2019-04-28 06:46:12','2019-06-01 07:43:05','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(193,2,'/audio/stetho_sounds/193.mp3',0,'心雑音　収縮早期','Heart murmur early contraction',2,'胸部','Chest',1,1,'―','―','雑音は収縮期早期に始まり中期で消失する/ 短かくやわらかい駆出性雑音/ 機能性雑音<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','Noise starts early in systole and disappears in the middle stage / short and soft ejection noise / functional noise <br>','無害性雑音','Harmless noise',1,0,0,'2019-04-28 06:47:09','2019-06-01 07:43:00','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(194,2,'/audio/stetho_sounds/194.mp3',0,'心　音　重合奔馬調律','Heart sound coincides with running horse tuning',2,'心尖部','Apex',1,0,'慢性うっ血性心不全','Chronic congestive heart failure','拡張期が短くなりⅢ音とⅣ音が重合して3番目の心音として、Ⅰ音、Ⅱ音とともに3拍子で聴かれる<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','The diastolic period is shortened, and the sound and the sound are superimposed and the third heart sound is heard in 3 beats together with the sound and the sound.','','',1,0,0,'2019-04-28 06:49:13','2019-06-01 07:42:56','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(195,2,'/audio/stetho_sounds/195.mp3',0,'心　音　Ⅳ音','Heart sound sound',2,'心尖部','Apex',1,1,'―','―','左室の伸展性が低下しているため拡張期に左房から左室への血液の急速流入が妨げられることが原因で生じる/ 左心房の収縮音/Ⅳ音はⅠ音の直前に生じⅠ音にマスクされ聴取しづらい<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','Due to reduced left ventricular extensibility, which prevents rapid influx of blood from the left atrium to the left ventricle during diastole. It is difficult to hear because it is masked by the sound','','',1,0,0,'2019-04-28 06:51:55','2019-06-01 07:42:51','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(196,2,'/audio/stetho_sounds/196.mp3',0,'心　音　Ⅲ音','Heart, sound, sound',2,'心尖部','Apex',1,1,'―','―','胸壁が薄く心筋の伸展性が良い若年健常者（30歳以下）で聴取される/ 左心房から流入してきた血液が心尖部に勢いよくぶつかる音（心室充満音）/ 40歳以上でⅢ音が聴取された場合やⅢ音が相対的に大きい場合は精査<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','Listening to healthy young people (thirty years or younger) with a thin chest wall and good myocardial extensibility / Sound of blood flowing from the left atrium hitting the apex of the heart (ventricular filling sound) Scrutinize if heard or the sound is relatively loud','','',1,0,0,'2019-04-28 06:52:31','2019-06-01 07:42:46','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(197,2,'/audio/stetho_sounds/197.mp3',0,'心　音　S2固定分裂','Heart Sound S2 fixed split',2,'心基部','Heart base',1,1,'―','―','大動脈弁と肺動脈弁の閉鎖が呼吸に無関係にずれを生じて発生/ 右室の電気刺激が左室よりも遅くなるために生じる/ 心電図上では完全右脚ブロックの所見となる<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','Occurrence of aortic and pulmonary valve closure due to displacement regardless of respiration / Occurs because electrical stimulation of right ventricle is slower than left ventricle / Complete right leg block is found on electrocardiogram <br> Cardiology Education and Research Group Chairman 髙 Kazuaki Fuka','','',1,0,0,'2019-04-28 06:53:43','2019-06-01 07:42:42','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(198,2,'/audio/stetho_sounds/198.mp3',0,'心　音　S2分裂呼吸性変動','Heart sound S2 split respiratory variability',2,'心基部','Heart base',1,1,'―','―','吸気時にS2が分裂/ 生理的分裂は吸気時に右心系の血流量が多くなるため、肺動脈弁の閉鎖が大動脈弁の閉鎖よりわずかに遅れることにより生じる<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','S2 splits during inspiration / Physiological splits occur when the right ventricular blood flow increases during inspiration, so the closure of the pulmonary valve is slightly delayed from the closure of the aortic valve. President: Kazuoka','','',1,0,0,'2019-04-28 06:54:27','2019-06-01 07:42:38','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(199,2,'/audio/stetho_sounds/199.mp3',0,'心　音　S1＜S2','Heart Sound S1 <S2',2,'心基部','Heart base',1,1,'―','―','心基部（大動脈弁部位）で心音はS1＜S2/ S２は大動脈弁と肺動脈弁がほとんど同時に閉鎖する時相に一致して発生する音で、その振動音が体表面に伝わった音<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','The heart sound at the base of the heart (aortic valve site) is S1 <S2 / S2, which is a sound generated at the same time when the aortic valve and the pulmonary valve close almost simultaneously, and the vibration sound is transmitted to the body surface <br> Supervision Educational Study Group for Clinical Cardiology President','','',1,0,0,'2019-04-28 06:55:53','2019-06-01 07:42:33','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(200,2,'/audio/stetho_sounds/200.mp3',0,'心　音　S1＞S2','Heart Sound S1 ＞ S2',2,'心尖部','Apex',1,1,'―','―','心尖部（僧帽弁部位）で心音はS1＞S2/ S１は僧帽弁と三尖弁がほとんど同時に閉鎖する時相に一致して発生する音で、その振動音が体表面に伝わった音<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','At the apex (mitral valve site), the heart sound is S1> S2 / S1 is the sound generated at the same time when the mitral and tricuspid valves close almost simultaneously, and the vibration sound is transmitted to the body surface <br> Supervision: Educational Research Group for Clinical Cardiology, President, Prof. Kazuoka','','',1,0,0,'2019-04-28 06:56:43','2019-06-01 07:42:28','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(201,2,'/audio/stetho_sounds/201.wav',0,'副雑音　スクウォーク３','Side noise @ Skwalk 3',1,'胸部','Chest',1,0,'気管支拡張症','Bronchiectasis','肺胞につながる細い気管支が、吸気により再解放することで気管支壁が短時間共振し発生する/短いキューッという高調のラ音（一瞬の笛音）/ 断続性ラ音（crackles）の出現に続いて認められることが多い<br>監修　杏林大学呼吸器内科　皿谷健先生','The thin bronchi connected to the alveoli are re-released by inhalation, causing the bronchial wall to resonate for a short period of time. Supervised by Kyorin University, Department of Respiratory Medicine, Ken Shiratani','','',1,0,0,'2019-04-28 06:59:15','2019-06-01 07:42:23','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(202,2,'/audio/stetho_sounds/202.wav',0,'副雑音　スクウォーク２','Side noise @ Skwalk 2',1,'胸部','Chest',1,0,'気管支拡張症','Bronchiectasis','肺胞につながる細い気管支が、吸気により再解放することで気管支壁が短時間共振し発生する/短いキューッという高調のラ音（一瞬の笛音）/ 断続性ラ音（crackles）の出現に続いて認められることが多い<br>監修　杏林大学呼吸器内科　皿谷健先生','The thin bronchi connected to the alveoli are re-released by inhalation, causing the bronchial wall to resonate for a short period of time. Supervised by Kyorin University, Department of Respiratory Medicine, Ken Shiratani','スクウォーク＋水泡音','Squawk + Bubble sound',1,0,0,'2019-04-28 06:59:41','2019-06-01 07:42:18','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(203,2,'/audio/stetho_sounds/203.wav',0,'副雑音　スクウォーク１','Side noise @ Skwalk 1',1,'胸部','Chest',1,0,'気管支拡張症','Bronchiectasis','肺胞につながる細い気管支が、吸気により再解放することで気管支壁が短時間共振し発生する/短いキューッという高調のラ音（一瞬の笛音）/ 断続性ラ音（crackles）の出現に続いて認められることが多い<br>監修　杏林大学呼吸器内科　皿谷健先生','The thin bronchi connected to the alveoli are re-released by inhalation, causing the bronchial wall to resonate for a short period of time. Supervised by Kyorin University, Department of Respiratory Medicine, Ken Shiratani','','