,1,0,'気管支喘息、COPD/気道病変を疑う','Suspicion of bronchial asthma, COPD / airway involvement','狭くなった気道壁を通過する気流が振動することにより発生/ 細い気管支が狭窄/ 高い音が持続する単音性ラ音<br>監修　杏林大学呼吸器内科　皿谷健先生','Oscillation of airflow passing through a narrowed airway wall / Narrow bronchial stenosis / Monophonic sound with continuous high sound <br>','','',1,0,0,'2019-04-28 07:07:39','2019-06-01 07:41:35','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(214,2,'/audio/stetho_sounds/214.wav',0,'副雑音　水泡音３','Side noise Bubble sound 3',1,'胸部','chest',1,0,'細菌性肺炎/気道病変・間質領域の病変を疑う','Suspected bacterial pneumonia / airway lesions / interstitial lesions','吸気・呼気時にブツブツという断続性ラ音（coarse crackles：水泡音）を聴取/ 病変部位肺野で聴取される<br>監修　杏林大学呼吸器内科　皿谷健先生','Listening to the intermittent crackling sound (coarse crackles) during inspiration and expiration / Listening to the affected area in the lung field <br> Supervised by Kyorin University','','',1,0,0,'2019-04-28 07:08:20','2019-06-01 07:41:31','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(215,2,'/audio/stetho_sounds/215.wav',0,'副雑音　水泡音２','Side noise Bubble sound 2',1,'胸部','chest',1,0,'細菌性肺炎/気道病変・間質領域の病変を疑う','Suspected bacterial pneumonia / airway lesions / interstitial lesions','吸気・呼気時にブツブツという断続性ラ音（coarse crackles：水泡音）を聴取/ 病変部位肺野で聴取される<br>監修　杏林大学呼吸器内科　皿谷健先生','Listening to the intermittent crackling sound (coarse crackles) during inspiration and expiration / Listening to the affected area in the lung field <br> Supervised by Kyorin University','','',1,0,0,'2019-04-28 07:08:47','2019-06-01 07:41:26','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(216,2,'/audio/stetho_sounds/216.wav',0,'副雑音　水泡音１','Auxiliary noise Bubble sound 1',1,'胸部','chest',1,0,'細菌性肺炎/気道病変・間質領域の病変を疑う','Suspected bacterial pneumonia / airway lesions / interstitial lesions','吸気・呼気時にブツブツという断続性ラ音（coarse crackles：水泡音）を聴取/ 病変部位肺野で聴取される<br>監修　杏林大学呼吸器内科　皿谷健先生','Listening to the intermittent crackling sound (coarse crackles) during inspiration and expiration / Listening to the affected area in the lung field <br> Supervised by Kyorin University','','',1,0,0,'2019-04-28 07:09:12','2019-06-01 07:41:22','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(217,2,'/audio/stetho_sounds/217.wav',0,'副雑音　捻髪音３','Auxiliary noise Creepy sound 3',1,'胸部','chest',1,0,'間質性肺炎/ 気道病変・間質領域の病変を疑う','Suspected interstitial pneumonia / airway lesions / interstitial lesions','吸気時に末梢気道が急激に開放して発生する音/ 吸気相でパリパリという断続性ラ音を聴く/主に下肺野背部で聴取される<br>監修　杏林大学呼吸器内科　皿谷健先生','A sound generated when the peripheral airway suddenly opens during inhalation / Intermittent raspy sound is heard in the inspiratory phase / Mainly heard in the lower lung field <br>','','',1,0,0,'2019-04-28 07:09:54','2019-06-01 07:41:17','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(218,2,'/audio/stetho_sounds/218.wav',0,'副雑音　捻髪音２','Auxiliary noise twisting sound 2',1,'胸部','chest',1,0,'間質性肺炎/気道病変・間質領域の病変を疑う','Suspected interstitial pneumonia / airway lesions / interstitial lesions','吸気時に末梢気道が急激に開放して発生する音/ 吸気相初期よりパリパリという断続性ラ音を聴く/主に下肺野背部で聴取される<br>監修　杏林大学呼吸器内科　皿谷健先生','A sound generated when the peripheral airway is suddenly opened during inspiration / A crisp sound is heard from the beginning of the inspiration phase / Listened mainly at the back of the lower lung field <br> Supervision: Kyorin University, Department of Respiratory Medicine, Ken Shiratani','','',1,0,0,'2019-04-28 07:10:19','2019-06-01 07:41:12','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(219,2,'/audio/stetho_sounds/219.wav',0,'副雑音　捻髪音１','Auxiliary noise twisting sound 1',1,'胸部','chest',1,0,'間質性肺炎/ 気道病変・間質領域の病変を疑う','Suspected interstitial pneumonia / airway lesions / interstitial lesions','吸気時に末梢気道が急激に開放して発生する音/ 吸気相でパリパリという断続性ラ音を聴く/主に下肺野背部で聴取される<br>監修　杏林大学呼吸器内科　皿谷健先生','A sound generated when the peripheral airway suddenly opens during inhalation / Intermittent raspy sound is heard in the inspiratory phase / Mainly heard in the lower lung field <br>','','',1,0,0,'2019-04-28 07:10:43','2019-06-01 07:41:07','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(220,2,'/audio/stetho_sounds/220.mp3',0,'正常音　肺胞呼吸音','Normal sound Alveolar breathing sound',1,'中下肺野','Middle and lower lung field',1,1,'―','―','肺野末梢で聴取され、吸気：呼気時間は3:1である。吸気のみで聴取され、呼気ではほぼ聴取されない。そよ風のような低音である。吸気努力を強める（勢いよく吸ってもらう）と肺胞呼吸音はより明瞭にきこえる。\r\n<br>監修　杏林大学呼吸器内科　皿谷健先生','It is heard at the periphery of the lung field and the inspiration: expiration time is 3: 1. It is heard only by inspiration, and is hardly heard by expiration. The sound is like a breeze. With increased inspiratory effort (heavy breathing), the alveolar breath sounds can be heard more clearly.\n<br> Supervision: Kyorin University, Department of Respiratory Medicine, Ken Shiratani','','',1,0,0,'2019-04-28 07:11:59','2019-06-01 07:41:03','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(221,2,'/audio/stetho_sounds/221.wav',0,'正常音　肺胞呼吸音0','Normal sound Alveolar breathing sound 0',1,'胸部','chest',1,1,'―','―','ー','ー','','',0,0,0,'2019-04-28 07:12:26','2019-04-29 13:07:40','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(225,2,'/audio/stetho_sounds/225.wav',0,'正常音　気管支呼吸音','Normal sound Bronchial breathing sound',1,'上中肺野','Upper middle lung field',1,1,'―','-','ルイス角（胸骨柄結合）のある気管分岐部周囲で聴取される音で、中等度の周波数（intermediate frequency）である。気管呼吸音より低く、肺胞呼吸音より高い音である。吸気：呼気時間は1:2程度とされるが、1:1と報告しているものもある。気管支肺胞呼吸音はより末梢に近い音（吸気：呼気時間＝1：1）であるが、気管支肺胞呼吸音と判別するのはしばしば困難と筆者は考えており、ここでは割愛する。\r\n<br>監修　杏林大学呼吸器内科　皿谷健先生','Sound heard around the tracheal bifurcation with the Lewis angle (sternal stalk joint), an intermediate frequency. The sound is lower than the tracheal breathing sound and higher than the alveolar breathing sound. Inspiration: Expiration time is around 1: 2, but some have reported 1: 1. Although the bronchoalveolar respiratory sounds are sounds closer to the periphery (inhalation: expiration time = 1: 1), I often think that it is difficult to distinguish them from bronchoalveolar respiratory sounds, and I omit them here.\n<br> Supervision: Kyorin University, Department of Respiratory Medicine, Ken Shiratani','','',1,0,0,'2019-05-03 00:30:55','2019-06-01 07:40:58','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(226,2,'/audio/stetho_sounds/226.wav',0,'正常音　気管呼吸音','Normal sound tracheal breathing sound',1,'頸部','neck',1,1,'ー','-','気管呼吸音は気管の上で聴取される幅広い周波数を持った音で、時に1000Hzまでの高音を呈する。吸気：呼気時間は１：１と考えてよいが、呼気時間がより長いとする報告や、周波数の幅が200Hz~2000Hzであるという報告もある。\r\n<br>監修　杏林大学呼吸器内科　皿谷健先生','Tracheal breathing sounds are sounds with a wide range of frequencies that are heard above the trachea, sometimes with treble up to 1000 Hz. The inspiration: expiration time may be considered to be 1: 1, but there are reports that the expiration time is longer, and that the frequency range is 200 Hz to 2000 Hz.\n<br> Supervision: Kyorin University, Department of Respiratory Medicine, Ken Shiratani','','',1,0,0,'2019-05-03 00:32:45','2019-06-01 07:40:52','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(227,2,'/audio/stetho_sounds/227.mp3',0,'Reserve','Reserve',1,'-','-',1,1,'-','-','ー','-','','',0,0,0,'2019-05-11 21:02:37','2019-05-11 21:02:37','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(228,2,'/audio/stetho_sounds/228.mp3',0,'-Reserve','Reserve',1,'-','-',1,1,'-','-','-','-','','',0,0,0,'2019-05-11 21:03:02','2019-05-11 21:03:02','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(229,2,'/audio/stetho_sounds/229.mp3',0,'Reserve','Reserve',1,'-','-',1,0,'-','-','-','-','','',0,0,0,'2019-05-11 21:03:36','2019-05-11 21:07:38','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(230,2,'/audio/stetho_sounds/230.mp3',0,'Reserve','Reserve',1,'-','-',1,1,'-','-','-','-','','',0,0,0,'2019-05-11 21:03:55','2019-05-11 21:03:55','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(231,2,'/audio/stetho_sounds/231.mp3',0,'Reserve','Reserve',1,'-','-',1,1,'-','-','-','-','','',0,0,0,'2019-05-11 21:04:12','2019-05-11 21:04:12','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(232,2,'/audio/stetho_sounds/232.mp3',0,'Reserve','Reserve',1,'-','-',1,1,'-','-','-','-','','',0,0,0,'2019-05-11 21:04:32','2019-05-11 21:04:32','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(233,2,'/audio/stetho_sounds/233.mp3',0,'Reserve','Reserve',1,'-','-',1,1,'-','-','-','-','','',0,0,0,'2019-05-11 21:04:47','2019-05-11 21:04:47','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(234,2,'/audio/stetho_sounds/234.mp4',0,'血圧','blood pressure',9,'-','-',1,1,'-','-','-','-','','',1,0,1000,'2019-05-11 21:05:14','2019-06-01 07:40:41','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(235,2,'/audio/stetho_sounds/235.mp3',0,'Lesson 拡張中期雑音MS','Lesson extended mid-term noise MS',2,'-','-',1,0,'ランブル音','Rumble sound','S2の後に僧帽弁開放音に続いて拡張中期にランブル音が聴かれます。\r\n<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','After S2, a rumble sound is heard in the middle diastole following the mitral valve opening sound.\n<br> Supervision Educational Study Group for Clinical Cardiology President','MS　正常心音5拍＋拡張中期雑音5拍','MS 5 normal heart sounds + 5 diastolic mid-term murmurs',1,0,0,'2019-05-11 21:05:28','2019-06-01 07:40:36','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(236,2,'/audio/stetho_sounds/236.wav',0,'Lesson 全収縮期雑音TR','Lesson total systolic noise TR',2,'-','-',1,0,'逆流性雑音','Backflow noise','吸気時に増大し呼気時に減弱する全収縮期逆流雑音です。\r\n<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','Total systolic reflux noise that increases during inspiration and decreases during expiration.\n<br> Supervision Educational Study Group for Clinical Cardiology President','TR　正常心音5拍＋全収縮期雑音吸気5拍＋呼気5拍','TR 5 normal heart sounds + total systolic murmur inspiration 5 + expiration 5',1,0,0,'2019-05-11 21:05:41','2019-06-01 07:40:33','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(237,2,'/audio/stetho_sounds/237.mp3',0,'Lesson 全収縮期雑音MR','Lesson total systolic noise MR',2,'-','-',1,0,'逆流性雑音','Backflow noise','S1にかぶさるように発生した逆流性雑音がS2まで持続的に聴かれます。\r\n<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','The backflow noise generated to cover S1 is continuously heard until S2.\n<br> Supervision Educational Study Group for Clinical Cardiology President','MR　正常心音5拍＋全収縮期雑音5拍','MR 5 normal heart sounds + 5 total systolic murmurs',1,0,0,'2019-05-11 21:05:54','2019-06-01 07:40:29','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(238,2,'/audio/stetho_sounds/238.wav',0,'Lesson 収縮後期雑音MVP','Lesson late systolic noise MVP',2,'-','-',1,0,'駆出性雑音','Ejective noise','収縮中期から後期にかけて駆出性雑音が聴かれます。 漸増漸減性雑音です。 \r\n<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','Ejective noise is heard from mid to late systole. Increasing and decreasing noise.\n<br> Supervision Educational Study Group for Clinical Cardiology President','MVP　正常心音5拍＋収縮後期雑音5拍','MVP 5 normal heart sounds + 5 late systolic murmurs',1,0,0,'2019-05-11 21:06:11','2019-06-01 07:40:23','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(239,2,'/audio/stetho_sounds/239.mp3',0,'Lesson 収縮中期雑音AS','Lesson mid-systolic noise AS',2,'-','-',1,0,'漸増漸減型の駆出性雑音','Ejective noise of increasing and decreasing type','収縮中期に漸増漸減する駆出性の雑音を聴きとります。\r\n<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','Hear an ejection noise that gradually increases and decreases during mid systole.\n<br> Supervision Educational Study Group for Clinical Cardiology President','AS　正常心音5拍＋収縮中期雑音5拍','AS 5 normal heart sounds + 5 mid-systolic murmurs',1,0,0,'2019-05-11 21:06:24','2019-06-01 07:40:18','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(240,2,'/audio/stetho_sounds/240.wav',0,'Lesson 収縮中期雑音ASD','Lesson Mid-systolic noise ASD',2,'-','-',1,0,'-','-','収縮中期雑音（相対的肺動脈狭窄）とS2の固定性分裂が聴かれます。\r\n<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','A mid-systolic murmur (relative pulmonary stenosis) and a fixed split of S2 are heard.\n<br> Supervision Educational Study Group for Clinical Cardiology President','ASD　S2固定分裂5拍＋収縮中期雑音5拍','ASD S2 fixed division 5 beats + mid-systolic noise 5 beats',1,0,0,'2019-05-11 21:07:59','2019-06-01 07:40:14','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(241,2,'/audio/stetho_sounds/241.mp3',0,'Lesson 収縮早期雑音','Lesson early contraction noise',2,'-','-',1,1,'駆出性雑音','Ejective noise','S1の後に柔らかく小さな雑音が聴こえます。これが機能性雑音（無害性雑音）です。\r\n<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','After S1, you will hear a soft little noise. This is functional noise (harmless noise).\n<br> Supervision Educational Study Group for Clinical Cardiology President','機能性雑音　正常5拍＋無害性雑音あり5拍','Functional noise: Normal 5 beats + Harmless noise with 5 beats',1,0,0,'2019-05-11 21:08:14','2019-06-01 07:40:10','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(242,2,'/audio/stetho_sounds/242.wav',0,'Lesson S2分裂','Lesson S2 split',2,'-','-',1,1,'-','-','吸気時にS2が分裂して聴こえます。吸気時は右心系の血流量が増えるため肺動脈弁の閉鎖がわずかに遅れることで分裂音が生じます。\r\n<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','S2 splits during inspiration and sounds audible. During inspiration, the right ventricular blood flow increases, and a slight delay in closing the pulmonary valve causes a split tone.\n<br> Supervision Educational Study Group for Clinical Cardiology President','正常5拍＋S2分裂5拍','Normal 5 beats + S2 split 5 beats',1,0,0,'2019-05-11 21:08:27','2019-06-01 07:40:06','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(243,2,'/audio/stetho_sounds/243.wav',0,'Lesson S4','Lesson S4',2,'-','-',1,1,'心房収縮音','Atrial contraction sound','1音の前に小さな低音成分が聴こえます。これが4音です。「ワ・カッ・タ」と聴こえます。\r\n<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','A small bass component can be heard before one note. These are four sounds. You can hear \"wa ka ta\".\n<br> Supervision Educational Study Group for Clinical Cardiology President','正常5拍＋Ⅳ音5拍','Normal 5 beats + 5 sounds',1,0,0,'2019-05-11 21:08:40','2019-06-01 07:40:02','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(244,2,'/audio/stetho_sounds/244.mp3',0,'Lesson S3','Lesson S3',2,'-','-',1,1,'急速流入音','Rapid inflow sound','2音の後に低音成分の音が小さく聴こえます。これが3音です。「ナッ・ト・ク」と聴こえます。\r\n<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','After two notes, the low-pitched sound is heard small. These are three sounds. You can hear \"Nut To Ku\".\n<br> Supervision Educational Study Group for Clinical Cardiology President','正常5拍＋Ⅲ音5拍','Normal 5 beats + 5 sounds',1,0,0,'2019-05-11 21:08:54','2019-06-01 07:39:57','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(245,2,'/audio/stetho_sounds/245.wav',0,'Lesson S2','Lesson S2',2,'-','-',1,1,'-','-','正常心音（S1＋S2）です。三尖弁部位と僧帽弁部位ではS1＞S2と聴こえます。\r\n<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生','Normal heart sound (S1 + S2). S1> S2 sounds at the tricuspid and mitral valve sites.\n<br> Supervision Educational Study Group for Clinical Cardiology President','S1+S2（S1>S2）','S1+S2（S1>S2）',1,0,0,'2019-05-11 21:09:09','2019-06-01 07:39:52','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(246,2,'/audio/stetho_sounds/246.wav',0,'Lesson  S1','Lesson  S1',2,'-','-',1,1,'-','-','正常心音からⅠ音だけを取り出しています。\r\n<br>監修　臨床心臓病学教育研究会　理事長　髙階經和先生\r\n<br>※ブラウザによっては音が聴こえないことがあります。<font color=\"red\">Chrome</font>または<font color=\"red\">Safari</font>でお聴きください。 \r\n','Only Ⅰ sounds are extracted from normal heart sounds.\n<br> Supervision Educational Study Group for Clinical Cardiology President\n<br> * Sound may not be heard depending on the browser. Listen on <font color = \"red\"> Chrome </ font> or <font color = \"red\"> Safari </ font>.','S1単独音','S1 single sound',1,0,0,'2019-05-11 21:09:23','2019-06-01 07:39:46','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(247,2,'/audio/stetho_sounds/247.mp3',0,'成育医療症例公開方針','Growth medical case disclosure policy',9,'-','-',1,1,'-','-','20190829音源とイラスト確認<br>\r\n004は２Rと２Lが違いすぎる。２Lに寄せて２Rの音を再編集する<br>\r\n004の腸音は不要<br>\r\n「正常音」の記載は誤解を招く⇒「雑音をdecreaseしたS１S2」などの表現に変更する<br>\r\n<br>\r\n20190614音源とイラスト確認<br>\r\n・音源はファロー四徴症と同様に加工する<br>\r\n　-murmurを消して正常パターンを作る<br>\r\n　-Lesson10拍＋10拍<br>\r\n　-時間を延長しbeatsを遅くする130％？<br>\r\n　-4つの部位をそれぞれ掲載⇒大人の分類とは一致しないかもしれない。心臓の形が違ったり響いたりする（心尖部でも肺動脈狭窄の収縮期雑音が聴こえることもある。小さい聴診器でも聴こえるので、聴診器のサイズが問題ではない）<br>\r\n・イラストは２DでDrZuKoラフ案のイラストが良い。正常と横並びにして表示する。<br>\r\n・新生児聴診ポイントをまとめて掲載するのがよい','20190829 Confirmation of sound source and illustration <br>\n004 is too different between 2R and 2L. Re-edit the sound of 2R to 2L <br>\nNo need for bowel sounds of 004\nThe description of \"normal sound\" is misleading ⇒ Change the expression to \"S1S2 with reduced noise\" <br>\n<br>\n20190614 Confirmation of sound source and illustration <br>\n・ The sound source is processed in the same way as tetralogy of Fallot <br>\nErase -murmur and make a normal pattern <br>\n-Lesson10 + 10 <br>\n-130% to extend time and slow down beats? <br>\n-4 sites listed separately⇒May not match adult classification. The heart shape is different or resounds (sometimes a systolic murmur of pulmonary artery stenosis can be heard even at the apex. The size of the stethoscope does not matter because it can be heard even with a small stethoscope) <br>\n-The illustration is 2D, and the draft of DrZuKo draft is good. Displayed side by side with normal. <br>\n・ It is good to post newborn auscultation points at once','甘利正一郎先生','Dr. Shoichiro Amari',3,0,0,'2019-05-31 06:44:22','2019-09-07 09:57:35','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(248,2,'/audio/stetho_sounds/248.wav',0,'成育001_心尖部','Growth 001_ apex',2,'心尖部','Apex',1,0,'ファロー四徴症','Tetralogy of Fallot','ファロー四徴症は、最も頻度の高いチアノーゼ性心疾患。\r\n「四徴」とは心室中隔欠損，肺動脈狭窄，右室肥大，大動脈騎乗を指す。肺動脈に流れるはずの静脈血が肺動脈狭窄と心室中隔欠損のため右心室から左心室を経由 して大動脈へ流れ込んでしまうため，動脈血中の酸素含量が低下し，チアノーゼ）が発生する。','Tetralogy of Fallot is the most common cyanotic heart disease.\n\"Tetralogy\" refers to ventricular septal defect, pulmonary artery stenosis, right ventricular hypertrophy, aortic riding. Venous blood, which should flow to the pulmonary artery, flows from the right ventricle to the aorta via the left ventricle due to pulmonary artery stenosis and ventricular septum defect, resulting in a decrease in oxygen content in arterial blood and cyanosis.','ファロー四徴症','Tetralogy of Fallot',3,0,7,'2019-06-01 07:22:47','2019-09-16 23:26:20','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(249,2,'/audio/stetho_sounds/249.wav',0,'成育001_4L','Growth 001_4L',2,'４L','４L',1,0,'ファロー四徴症','Tetralogy of Fallot','ファロー四徴症は、最も頻度の高いチアノーゼ性心疾患。\r\n「四徴」とは心室中隔欠損，肺動脈狭窄，右室肥大，大動脈騎乗を指す。肺動脈に流れるはずの静脈血が肺動脈狭窄と心室中隔欠損のため右心室から左心室を経由 して大動脈へ流れ込んでしまうため，動脈血中の酸素含量が低下し，チアノーゼ）が発生する。','Tetralogy of Fallot is the most common cyanotic heart disease.\n\"Tetralogy\" refers to ventricular septal defect, pulmonary artery stenosis, right ventricular hypertrophy, aortic riding. Venous blood, which should flow to the pulmonary artery, flows from the right ventricle to the aorta via the left ventricle due to pulmonary artery stenosis and ventricular septum defect, resulting in a decrease in oxygen content in arterial blood and cyanosis.','ファロー四徴症','Tetralogy of Fallot',3,0,6,'2019-06-01 07:24:53','2019-09-16 23:26:40','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(250,2,'/audio/stetho_sounds/250.wav',0,'成育001_2L','Growth 001_2L',2,'２L','２L',1,0,'ファロー四徴症','Tetralogy of Fallot','ファロー四徴症は、最も頻度の高いチアノーゼ性心疾患。\r\n「四徴」とは心室中隔欠損，肺動脈狭窄，右室肥大，大動脈騎乗を指す。肺動脈に流れるはずの静脈血が肺動脈狭窄と心室中隔欠損のため右心室から左心室を経由 して大動脈へ流れ込んでしまうため，動脈血中の酸素含量が低下し，チアノーゼ）が発生する。','Tetralogy of Fallot is the most common cyanotic heart disease.\n\"Tetralogy\" refers to ventricular septal defect, pulmonary artery stenosis, right ventricular hypertrophy, aortic riding. Venous blood, which should flow to the pulmonary artery, flows from the right ventricle to the aorta via the left ventricle due to pulmonary artery stenosis and ventricular septum defect, resulting in a decrease in oxygen content in arterial blood and cyanosis.','ファロー四徴症','Tetralogy