teriosus has disappeared. There remains a heart murmur, probably tricuspid regurgitation.\n中 で The breathing sound is right <left probably because the atelectasis was formed on the right because the patient was still intubated.\n007: Age 20. After extubation. Upper airway stenosis is caused by glottic edema, and wheezing is heard during inspiration.\n喘 The wheezing disappeared within a few days.','動脈管開存在胎38週正規産児','38-week-old normal infant with open duct',3,0,32,'2019-09-11 00:22:38','2019-09-16 23:41:12','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(361,2,'/audio/stetho_sounds/361.wav',0,'成育008_2R','Growth 008_2R',2,'２R','２R',1,0,'機能性雑音','Functional noise','在胎37週3日，出生体重2904gの児で，日齢1に採録．\r\n　　心エコー上は雑音の源を特定できず，機能性雑音と診断した．\r\n\r\nmemo20191019\r\n・心音はベルモードで出力\r\n・腸音はベルモードを加工\r\n・２Lは呼吸音が聴こえる\r\n・心音の各ファイルはボリューム調整し均一化した','A baby with a birth weight of 2904 g and a gestational age of 37 weeks and 3 days.\nThe source of the noise could not be identified on echocardiography, and the patient was diagnosed with functional noise.\n\nmemo20191019\n・ Heart sound is output in bell mode\n-Bowel sound processed bell mode\n・ 2L can hear breath sounds\n・ The volume of each heart sound file has been adjusted and made uniform.','症例５：在胎37週3日，出生体重2904gの児','Case 5: 37-week-gestational gestation at 37 weeks 3 days, birth weight 2904g',3,0,80,'2019-10-20 03:04:35','2019-10-20 03:09:30','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(362,2,'/audio/stetho_sounds/362.wav',0,'成育008_2L','Growth 008_2L',2,'２Ｌ','２Ｌ',1,1,'無害性雑音','Functional noise','在胎37週3日，出生体重2904gの児で，日齢1に採録．\r\n心エコー上は雑音の源を特定できず，機能性雑音と診断した\r\n呼吸音あり','A baby with a birth weight of 2904 g and a gestational age of 37 weeks and 3 days.\nThe source of the noise could not be identified on echocardiography, and the patient was diagnosed with functional noise.\n\nmemo20191019\n・ Heart sound is output in bell mode\n-Bowel sound processed bell mode\n・ 2L can hear breath sounds\n・ The v