re) / phase perceived as noise with decompression (Phase 2), phase with louder sound (Phase 3), phase with steeply weaker sound (Phase 2), phase with deafness changed to point 5 (diastolic blood pressure).           \r\n            \r\n            \r\n            \r\n            ','PR 80 bpm',NULL,2,1,20,'2019-10-23 09:08:57','2020-04-21 05:21:56',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(480,2,'/audio/stetho_sounds/480.mp3',0,NULL,'Korotkoff sounds-3',9,NULL,'-',1,1,NULL,'Blood pressure exam',NULL,'                                    A Korotkoff sounds are made in the blood stream when an artery in the upper arm is compressed with a cuff to block the artery, followed by decompression. / The 1st point is that the sound synchronized with the heartbeat begins to sounds (systolic blood pressure) / phase perceived as noise with decompression (Phase 2), phase with louder sound (Phase 3), phase with steeply weaker sound (Phase 2), phase with deafness changed to point 5 (diastolic blood pressure).       \r\n            \r\n            \r\n            ','PR 68 bpm',NULL,2,1,22,'2019-10-23 09:09:35','2020-04-21 05:21:35',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(481,2,'/audio/stetho_sounds/481.mp3',0,NULL,'Guru sounds-3',3,NULL,'abdomen',1,1,NULL,'-',NULL,'            Peristaltic sounds propagate throughout the abdomen, so 1 ~ 2 auscultation positions are sufficient / Normal: At least 5 times per minute, Decreased: 1 ~ 2 times per minute (Constipation, peritonitis, paralytic ileus, decreased bowel movement due to surgery), Loss: No crackles for 5 minutes (Functional ileus and peritonitis), High: Always heard (Infectious enteritis, diarrhea, intestinal obstruction). \r\n            ','Normal 3',NULL,2,1,26,'2019-10-23 09:10:28','2020-04-21 05:20:58',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(482,2,'/audio/stetho_sounds/482.mp3',0,NULL,'Guru sounds-2',3,NULL,'abdomen',1,1,NULL,'-',NULL,'            Peristaltic sounds propagate throughout the abdomen, so 1 ~ 2 auscultation positions are sufficient / Normal: At least 5 times per minute, Decreased: 1 ~ 2 times per minute (Constipation, peritonitis, paralytic ileus, decreased bowel movement due to surgery), Loss: No crackles for 5 minutes (Functional ileus and peritonitis), High: Always heard (Infectious enteritis, diarrhea, intestinal obstruction). \r\n            ','Normal 2',NULL,2,1,27,'2019-10-23 09:11:30','2020-04-21 05:20:48',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(483,2,'/audio/stetho_sounds/483.mp3',0,NULL,'Guru sounds-1',3,NULL,'abdomen',1,1,NULL,'-',NULL,'                                    Peristaltic sounds propagate throughout the abdomen, so 1 ~ 2 auscultation positions are sufficient / Normal: At least 5 times per minute, Decreased: 1 ~ 2 times per minute (Constipation, peritonitis, paralytic ileus, decreased bowel movement due to surgery), Loss: No crackles for 5 minutes (Functional ileus and peritonitis), High: Always heard (Infectious enteritis, diarrhea, intestinal obstruction). \r\n            \r\n            \r\n            ',' Normal 1',NULL,3,1,28,'2019-10-23 09:12:09','2020-04-21 05:20:38',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(484,2,'/audio/stetho_sounds/484.mp3',0,NULL,'Guru sounds-4',3,NULL,'abdomen',1,0,NULL,'Mechanical ileus',NULL,'            Sounds produced when the intestinal lumen is obstructed by intussusception, volvulus, adhesions, intestinal hernias or tumors and the fluid moves through that area / the sound is high pitched and metallic.\r\n            ','Metallic sounds',NULL,2,1,25,'2019-10-23 09:12:54','2020-04-21 05:21:08',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(485,2,'/audio/stetho_sounds/485.mp3',0,NULL,'Heart sounds-16',2,NULL,'P',1,0,NULL,'Patent ductus arteriosus(PDA)',NULL,'                                                            PDA / The pressure difference between the pulmonary artery and the aortic shunt generates a murmur / Continuous murmur that occurs during both systole and diastole.            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','Continuous murmur/PDA',NULL,2,1,68,'2019-10-23 09:28:36','2020-04-21 05:12:08',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(486,2,'/audio/stetho_sounds/486.mp3',0,NULL,'Heart sounds-15',2,NULL,'M',1,0,NULL,'Mitral Stenosis (MS)',NULL,'                        MS/ Mid diastolic murmur (rumble) / Following opening of the mitral valve (OS), turbulent blood flows from the left atrium into the left ventricle, generating rumbling sounds.         \r\n            \r\n            \r\n            \r\n            \r\n            ','Middle diastolic rumble/MS',NULL,2,1,69,'2019-10-23 09:29:27','2020-04-21 05:12:00',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(487,2,'/audio/stetho_sounds/487.mp3',0,NULL,'Heart sounds-14',2,NULL,'T',1,0,NULL,'Aortic regargitation (AR)',NULL,'                                                AR / Systolic ejection murmur and decrescendo murmur from early diastole are heard, and in moderate case, diastolic rumble（Austin-Frint) is heard at the mitral valve area. \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','Early diastolic murmur/AR',NULL,2,1,70,'2019-10-23 09:30:27','2020-04-22 10:58:10',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(488,2,'/audio/stetho_sounds/488.mp3',0,NULL,'Heart sounds-13',2,NULL,'T',1,0,NULL,'Tricuspid regurgitation(TR)',NULL,'                                    TR/ Holosystolic murmur is heard in the left lower sternal border and increases in volume during inspiration（Rivelo Carvallo sign).\r\n            \r\n            \r\n            \r\n            ','Holosystolic murmur/TR',NULL,2,1,71,'2019-10-23 09:31:12','2020-04-21 05:11:41',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(489,2,'/audio/stetho_sounds/489.mp3',0,NULL,'Heart sounds-12',2,NULL,'M',1,0,NULL,'Mitral Regurgitation(MR)',NULL,'                                    MR/ Holosystolic murmur begins with  S1 persists to S2.\r\n            \r\n            \r\n            \r\n            \r\n            ','Holosystolic murmur/MR',NULL,2,1,72,'2019-10-23 09:32:09','2020-04-21 05:11:31',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(490,2,'/audio/stetho_sounds/490.mp3',0,NULL,'Heart sounds-11',2,NULL,'M',1,0,NULL,'Mitral valve prolapse(MVP)',NULL,'                                                MVP/ Crescendo murmur heard in late systole following a click in mid-systole / and the murmur continues to S2.\r\n            \r\n            \r\n            \r\n            \r\n            ','Late Systolic murmur/MVP',NULL,2,1,73,'2019-10-23 09:33:00','2020-04-21 05:11:21',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(491,2,'/audio/stetho_sounds/491.mp3',0,NULL,'Heart sounds-10',2,NULL,'P',1,0,NULL,'Atrial septal defect (ASD)',NULL,'                                    ASD / Middle systolic murmur (relative pulmonary stenosis) and fixed S2 split at the pulmonic valve area.\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','Middle systolic murmur/ASD',NULL,2,1,74,'2019-10-23 09:33:49','2020-04-21 05:11:12',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(492,2,'/audio/stetho_sounds/492.mp3',0,NULL,'Heart sounds-9',2,NULL,'A',1,0,NULL,'Aortic stenosis (AS)',NULL,'            AS / Middle systolic ejection murmur is heard just before S2.      \r\n            \r\n            \r\n            \r\n            ','Middle systolic murmur/AS',NULL,2,1,75,'2019-10-28 00:15:27','2020-04-21 05:11:02',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(493,2,'/audio/stetho_sounds/493.mp3',0,NULL,'Heart sounds-8',2,NULL,'Any heart auscultation area',1,1,NULL,'-',NULL,'                                                                                                                                    Early systolic murmur/ Ejection murmur (functional murmur)/ Beginning early in systole and fading out in mid-systole / short and soft sounds.\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','Early systolic murmur/Innocent',NULL,2,1,76,'2019-10-28 00:16:50','2020-04-22 10:58:37',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(494,2,'/audio/stetho_sounds/494.mp3',0,NULL,'Heart Sounds-7',2,NULL,'M',1,0,NULL,'Chronic congestive heart failure',NULL,'                                    Summation gallop/ Dilated cardiomyopathy with heart failure / with a shortened diastole, S3 and S4 are superimposed and heard in triple time as the third heart sounds.\r\n            \r\n            \r\n            \r\n            ','Summation gallop',NULL,2,1,77,'2019-10-28 00:18:31','2020-04-21 05:10:40',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(495,2,'/audio/stetho_sounds/495.mp3',0,NULL,'Heart Sounds-6',2,NULL,'M',1,0,NULL,'Hypertrophic cardiomyopathy, Dilated cardiomyopathy',NULL,'                                                            S4 gallop /  Decreased left ventricular distensibility / caused by obstruction of the rapid blood  flow from the left atrium into the left ventricle during diastole / S4 occurs just before S1 and is masked by S1, making it difficult to hear. / These sounds are near the lower frequency limit of hearing.the sound in question disappears with either by pressure on the ball or changing to the diaphragm.\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','S4 gallop',NULL,2,1,78,'2019-10-28 00:19:21','2020-04-21 05:09:37',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(496,2,'/audio/stetho_sounds/496.mp3',0,NULL,'Heart Sounds-5',2,NULL,'M',1,1,NULL,'-',NULL,'                                                                        S3 gallop / Heard in young healthy people (Under 30 years old) with thin chest walls and good myocardial distensibility / the sound of blood filling into left ventricle from the left atrium / closer examination is needed, if the patient is above 50 years or older has S3 and / or if the S4 are relatively loud.            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','S3 gallop',NULL,2,1,79,'2019-10-28 00:20:15','2020-04-21 05:10:24',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(497,2,'/audio/stetho_sounds/497.mp3',0,NULL,'Heart Sounds-4',2,NULL,'P',1,0,NULL,'Right ventricular septal myocardial infarction, Complete right bundle branch block',NULL,'                                                                        S2 fixed split  /  Aortic and pulmonic valve closure occurs independently of respiration  /  caused by slower electrical stimulation of the right ventricle than the left  /  when ECG showing complete right bundle branch block.\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','S2 fixed split',NULL,2,1,80,'2019-10-28 00:21:06','2020-04-21 05:10:16',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(498,2,'/audio/stetho_sounds/498.mp3',0,NULL,'Heart Sounds-3',2,NULL,'P',1,1,NULL,'-',NULL,'                                                                                    S2 split during inspiration/ results from a slightly delayed closure of the pulmonary valve compared with the aortic valve because of increased right-sided flow volume during inspiration.\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','S2 split with respirations',NULL,2,1,81,'2019-10-28 00:21:50','2020-04-21 05:10:09',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(499,2,'/audio/stetho_sounds/499.mp3',0,NULL,'Heart Sounds-2',2,NULL,'T, M',1,1,NULL,'-',NULL,'                                                                                    Apex (mitral valve area) heart sounds are S1>S2  /  S1 generated when the mitral and tricuspid valves close almost simultaneously.\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','S1 > S2/Normal',NULL,3,1,82,'2019-10-28 00:44:51','2020-04-21 05:09:56',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(500,2,'/audio/stetho_sounds/500.mp3',0,NULL,'Heart Sounds-1',2,NULL,'A,P',1,1,NULL,'-',NULL,'<p><span style=\"font-size: 12pt;\">Heart sounds at the base (aortic and pulmonary valve site) </span><span style=\"font-size: 12pt;\">are S1 &lt; S2 / S2 generated when the aortic and pulmonary valves close almost simultaneously.</span></p>','S1 < S2/Normal ',NULL,3,1,83,'2019-10-28 00:45:52','2020-05-04 19:35:03',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(501,2,'/audio/stetho_sounds/501.mp3',0,NULL,'Lung sounds-19',1,NULL,'Chest',1,0,NULL,'bronchiectasis',NULL,'            The narrow bronchus leading to the alveoli is reopened by inspiration, causing a brief resonance in the bronchial wall/ a short squeaking high-pitched sound/ often followed by the appearance of crackles.\r\n            ','Squawk+CoarseCrackles3',NULL,2,1,35,'2019-10-28 00:46:52','2020-04-21 05:19:40',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(502,2,'/audio/stetho_sounds/502.mp3',0,NULL,'Lung sounds-18',1,NULL,'Chest',1,0,NULL,'bronchiectasis',NULL,'            The narrow bronchus leading to the alveoli is reopened by inspiration, causing a brief resonance in the bronchial wall/ a short squeaking high-pitched sound/ often followed by the appearance of crackles.\r\n            ','Squawk+CoarseCrackles2',NULL,2,1,36,'2019-10-28 00:47:33','2020-04-21 05:19:31',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(503,2,'/audio/stetho_sounds/503.mp3',0,NULL,'Lung sounds-17',1,NULL,'Chest',1,0,NULL,'bronchiectasis',NULL,'            The narrow bronchus leading to the alveoli is reopened by inspiration, causing a brief resonance in the bronchial wall / a short squeaking high-pitched sound / often followed by the appearance of crackles.\r\n            ','Squawk+CoarseCrackles1',NULL,2,1,37,'2019-10-28 00:48:24','2020-04-21 05:19:21',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(504,2,'/audio/stetho_sounds/504.mp3',0,NULL,'Lung sounds-20',1,NULL,'Chest',1,0,NULL,'pleurisy',NULL,'            The visceral pleura, which adheres closely to the lungs, and the parietal pleura, which lies outside the visceral pleura, rub against each other, causing a squeezing sound that is heard along with breathing/ inflammation of the pleura may be present at an un-radiographically detectable level/ Disappear when pleural effusion separates the pleura.\r\n            ','Pleural friction rub',NULL,2,1,34,'2019-10-28 00:49:16','2020-04-21 05:19:48',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(505,2,'/audio/stetho_sounds/505.mp3',0,NULL,'Lung sounds-16',1,NULL,'Chest',1,0,NULL,'bronchial asthma, COPD/ suspect respiratory tract lesions ',NULL,'            Occurred by vibration of sticky secretions attached to the airway wall / a rumbling sound like snoring/ continuous rales during exhalation.\r\n            ','Rhonchi 2',NULL,2,1,38,'2019-10-28 00:50:08','2020-04-21 05:19:13',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(506,2,'/audio/stetho_sounds/506.mp3',0,NULL,'Lung sounds-15',1,NULL,'Chest',1,0,NULL,'bronchial asthma, COPD/ suspect respiratory tract lesions',NULL,'            Occurred by vibration of sticky secretions attached to the airway wall / a rumbling sound like snoring / continuous rales during exhalation.\r\n            ','Rhonchi１',NULL,2,1,39,'2019-10-28 02:20:34','2020-04-21 05:19:06',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(507,2,'/audio/stetho_sounds/507.mp3',0,NULL,'Lung sounds-14',1,NULL,'Chest',1,1,NULL,'bronchial asthma, COPD/ suspect respiratory tract lesions',NULL,'            Caused by the vibration of air flow passing through the narrowed airway wall/ Many wheezes heard in the chest are also heard in the neck/ Multiple continuous rales.\r\n            ','Wheezes polyphonic 2',NULL,2,1,40,'2019-10-28 02:21:52','2020-04-21 05:18:59',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(508,2,'/audio/stetho_sounds/508.mp3',0,NULL,'Lung sounds-13',1,NULL,'Chest',1,0,NULL,'bronchial asthma, COPD/ suspect respiratory tract lesions ',NULL,'            Caused by the vibration of air flow passing through the narrowed airway wall/ Many wheezes heard in the chest are also heard in the neck/ Multiple continuous rales.\r\n            ','Wheezes polyphonic 1',NULL,2,1,41,'2019-10-28 02:22:51','2020-04-21 05:18:50',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(509,2,'/audio/stetho_sounds/509.mp3',0,NULL,'Lung sounds-12',1,NULL,'Chest',1,0,NULL,'bronchial asthma, COPD/ suspect respiratory tract lesions',NULL,'            Caused by the vibration of air flow passing through the narrowed airway wall/ Thin bronchi narrowed/ monophonic rale with sustained high-pitched sounds.\r\n            ','Wheezes monophonic 3',NULL,2,1,42,'2019-10-28 02:23:38','2020-04-21 05:18:41',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(510,2,'/audio/stetho_sounds/510.mp3',0,NULL,'Lung sounds-11',1,NULL,'Chest',1,0,NULL,'bronchial asthma, COPD/ suspect respiratory tract lesions',NULL,'            Caused by the vibration of air flow passing through the narrowed airway wall/ Thin bronchi narrowed/ monophonic rale with sustained high-pitched sounds.\r\n            ','Wheezes monophonic 2',NULL,2,1,43,'2019-10-28 02:24:24','2020-04-21 05:18:33',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(511,2,'/audio/stetho_sounds/511.wav',0,'成育035_左側胸部','Coarse crackles1\n\n',1,'左側胸部','Chest',1,0,'気胸・縦隔気腫','Suspect bacterial pneumonia and /or airway lesions,　interstitial lesions\n','38週6日，3916gで出生した児．帝王切開で，Apgarスコア 57の軽度新生児仮死．気胸・縦隔気腫あり．\r\n\r\n\r\n日齢1での録音．動脈管開存の雑音がある他，気胸・縦隔気腫のために心音が「遠く（こもって）」聞こえる．\r\n','Intermittent rales (coarse crackles) during inspiration and expiration.\n\n','症例21：38週6日，3916gで出生した児．帝王切開','',3,0,375,'2019-10-28 02:25:09','2019-10-28 02:25:09','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(512,2,'/audio/stetho_sounds/512.wav',0,'成育035_腹部','Fine crackles3\n\n',1,'腹部','Lower lung field\n',1,0,'気胸・縦隔気腫','Interstitial pneumonia/ airway lesion, interstitial area lesion suspected\n','38週6日，3916gで出生した児．帝王切開で，Apgarスコア 57の軽度新生児仮死．気胸・縦隔気腫あり．\r\n\r\n\r\n日齢1での録音．動脈管開存の雑音がある他，気胸・縦隔気腫のために心音が「遠く（こもって）」聞こえる．\r\n','Sounds made by the sudden opening of the small airways during inspiration/ listen for crunchy crackles late inspiratory phase/ pay attention to listen in lower back lung fields.\n\n','症例21：38週6日，3916gで出生した児．帝王切開','',3,0,376,'2019-10-28 02:25:51','2019-10-28 02:25:51','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(513,2,'/audio/stetho_sounds/513.wav',0,'成育037_2R','Fine crackles2\n\n',1,'2R','Lower lung field\n',1,0,'気胸・縦隔気腫','Interstitial pneumonia/ airway lesion, interstitial area lesion suspected\n','035と同じ児．日齢5での録音．気胸は改善している．\r\n　　雑音が消失．「遠く，こもった」感じもなくなった．','Sounds made by the sudden opening of the small airways during inspiration/ listen for crunchy crackles early in the inspiratory phase/ pay attention to listen in lower back lung fields.\n\n','症例21：38週6日，3916gで出生した児．帝王切開','',3,0,380,'2019-10-28 02:44:44','2019-10-28 02:44:44','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(514,2,'/audio/stetho_sounds/514.mp3',0,NULL,'Lung sounds-10',1,NULL,'Chest',1,0,NULL,'bronchial asthma, COPD/ suspect respiratory tract lesions',NULL,'            Caused by the vibration of air flow passing through the narrowed airway wall/ Thin bronchi narrowed/ monophonic rale with sustained high-pitched sounds.    \r\n            ','Wheezes monophonic 1',NULL,2,1,44,'2019-10-28 02:45:34','2020-04-21 05:18:23',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(515,2,'/audio/stetho_sounds/515.mp3',0,NULL,'Lung sounds-9',1,NULL,'Chest',1,0,NULL,'Suspect bacterial pneumonia and /or airway lesions,　interstitial lesions',NULL,'            Intermittent rales (coarse crackles) during inspiration and expiration.         \r\n            \r\n            ','Coarse crackles 3',NULL,2,1,45,'2019-10-28 02:46:21','2020-04-21 05:18:16',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(516,2,'/audio/stetho_sounds/516.mp3',0,NULL,'Lung sounds-8',1,NULL,'Chest',1,0,NULL,'Suspect bacterial pneumonia and /or airway lesions,　interstitial lesions',NULL,'            Intermittent rales (coarse crackles) during inspiration.           \r\n            \r\n            ','Coarse crackles 2',NULL,2,1,46,'2019-10-28 02:47:11','2020-04-21 05:18:10',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(517,2,'/audio/stetho_sounds/517.mp3',0,NULL,'Lung sounds-7',1,NULL,'Chest',1,0,NULL,'Suspect bacterial pneumonia and /or airway lesions,　interstitial lesions',NULL,'            Intermittent rales (coarse crackles) during inspiration and expiration.     \r\n            \r\n            \r\n            \r\n            ','Coarse crackles 1',NULL,2,1,47,'2019-10-28 02:48:05','2020-04-21 05:18:01',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(518,2,'/audio/stetho_sounds/518.mp3',0,NULL,'Lung sounds-6',1,NULL,'Lower lung field',1,0,NULL,'Interstitial pneumonia/ airway lesion, interstitial area lesion suspected',NULL,'                                                Sounds made by the sudden opening of the small airways during inspiration/ listen for crunchy crackles late inspiratory phase/ pay attention to listen in lower back lung fields.\r\n            \r\n            \r\n            \r\n            ','Fine crackles 3',NULL,2,1,48,'2019-10-28 02:48:46','2020-04-22 10:41:52',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(519,2,'/audio/stetho_sounds/519.mp4',0,NULL,'Lung sounds-5',1,NULL,'Lower lung field',1,0,NULL,'Interstitial pneumonia/ airway lesion, interstitial area lesion suspected',NULL,'                                    Sounds made by the sudden opening of the small airways during inspiration/ listen for crunchy crackles early in the inspiratory phase/ pay attention to listen in lower back lung fields.         \r\n            \r\n            \r\n            ','Fine crackles 2',NULL,2,1,49,'2019-10-28 02:49:31','2020-04-22 10:42:01',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(520,2,'/audio/stetho_sounds/520.mp4',0,NULL,'Lung sounds-4',1,NULL,'Lower lung field',1,0,NULL,'Interstitial pneumonia/ airway lesion, interstitial area lesion suspected',NULL,'Sounds made by the sudden opening of the small airways during inspiration/ listen for crunchy crackles early in the inspiratory phase/ pay attention to listen in lower back lung fields.','Fine crackles 1',NULL,2,1,50,'2019-10-28 03:09:50','2020-06-29 19:05:59',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(521,2,'/audio/stetho_sounds/521.mp3',0,NULL,'Lung sounds-3',1,NULL,'Middle and lower lung field',1,1,NULL,'-',NULL,'            Heard in the lower and middle lung field, and the ratio of inspiratory: expiratory time is 3: 1. Audible only on inspiration and almost never on expiration. low, like a breeze. An increased inspiratory effort (Inhale vigorously) produces a clearer audible alveolar breath sound.\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','Vesicular sounds',NULL,3,1,51,'2019-10-28 03:10:56','2020-04-21 05:17:31',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(522,2,'/audio/stetho_sounds/522.mp3',0,NULL,'Lung sounds-2',1,NULL,'Upper and middle lung field',1,1,NULL,'-',NULL,'            Sounds heard around the carina at the level of Lewis angle with intermediate frequency. The frequency of bronchial sounds is lower than tracheal sounds, while, higher than in vesicular sounds. Inhalation: Expiratory time is considered as 1: 2, but in some cases 1: 1. Although bronchovesicular sounds are noted at peripheral lung fields (Insp vs Exp time is 1:1), which are hardly discriminate from bronchial sounds, thereby not discussed here. \r\n            ','Bronchial sounds',NULL,3,1,52,'2019-10-28 03:11:46','2020-04-21 05:17:07',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(523,2,'/audio/stetho_sounds/523.mp3',0,NULL,'Lung sounds-1',1,NULL,'Neck',1,1,NULL,'-',NULL,'                        Tracheal breath sounds are broad frequencies heard over the trachea, sometimes as high as 1000 Hz. The duration of inspiratory (Insp) vs expiratory (Exp) phase is 1: 1, although Exp phase might be longer than that of Insp. The frequency ranges between 200 Hz to 2000 Hz.\r\n            \r\n            ','Tracheal sounds',NULL,3,1,53,'2019-10-28 03:12:45','2020-04-21 05:16:33',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(524,2,'/audio/stetho_sounds/524.mp3',0,NULL,'Stepwise lesson-14',2,NULL,'M',1,0,NULL,'Mitral Stenosis (MS)',NULL,'                                                            An opening snap followed by a mid-diastolic rumbling is heard.            \r\n           \r\n            Normal heart sound (5 beats) + mid diastolic murmur (5 beats)\r\n            \r\n            \r\n            \r\n            ','Middle diastolic rumble/MS',NULL,2,1,54,'2019-10-28 03:13:31','2020-04-21 05:16:24',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(525,2,'/audio/stetho_sounds/525.mp3',0,NULL,'Stepwise lesson-12',2,NULL,'T',1,0,NULL,'Tricuspid regurgitation (TR)',NULL,'                                                            Holosystolic murmur that increases in volume during inspiration and decreases during expiration. \r\nNormal heart sound (5 beats) + holo systolic murmur(inspiration) (5 beats) + exhalation (5 beats)\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','Holo systolic murmur/TR',NULL,2,1,56,'2019-10-28 03:14:13','2020-04-21 05:16:04',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(526,2,'/audio/stetho_sounds/526.mp3',0,NULL,'Stepwise lesson-11',2,NULL,'M',1,0,NULL,'Mitral Regurgitation (MR)',NULL,'                                                                        Regurgitant murmur over laping S1 is heard continued until S2.      \r\nNormal heart sound (5 beats) + holo systolic murmur (5 beats)\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','Holo systolic murmur/MR',NULL,2,1,57,'2019-10-28 03:14:55','2020-04-21 05:15:52',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(527,2,'/audio/stetho_sounds/527.mp3',0,NULL,'Stepwise lesson-10',2,NULL,'M',1,0,NULL,'Mitral valve prolapse (MVP)',NULL,'                                                            Ejection murmur(crescendo) is heard from midsystolic to late systolic.\r\nNormal heart sound (5 beats) + late systolic murmur (5 beats)\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','Late systolic murmur/MVP',NULL,2,1,58,'2019-10-28 04:45:18','2020-04-21 05:15:43',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(528,2,'/audio/stetho_sounds/528.mp3',0,NULL,'Stepwise lesson-9',2,NULL,'P',1,0,NULL,'Atrial septal defect (ASD)',NULL,'                                                            Crescendo and decrescendo ejection murmur heard in mid systole.            \r\n            Normal heart sound,S2 split (5 beats) + mid systolic murmur (5 beats)\r\n            \r\n            \r\n            \r\n            \r\n            ','Middle systolic murmur/ASD',NULL,2,1,59,'2019-10-28 04:46:08','2020-04-21 05:15:32',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(529,2,'/audio/stetho_sounds/529.mp3',0,NULL,'Stepwise lesson-8',2,NULL,'A',1,0,NULL,'Aortic stenosis (AS)',NULL,'                                                            Mid systolic murmur (relative pulmonary artery stenosis) and  fixed splitting of S2 are listened.            \r\n            S2 fixed split (5 beats) ＋ mid syst murmur (5 beats)\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','Middle systolic murmur/AS',NULL,2,1,60,'2019-10-28 04:46:58','2020-04-21 05:15:24',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(530,2,'/audio/stetho_sounds/530.mp3',0,NULL,'Stepwise lesson-7',2,NULL,'-',1,0,NULL,'Innocent murmur',NULL,'                                                Soft little noise after S1. This is the functional murmur (innocent murmur).\r\n                     Normal heart sound (5 beats) + early syst murmur (5 beats)\r\n            \r\n            \r\n            \r\n            ','Early systolic murmur',NULL,2,1,61,'2019-10-28 04:48:20','2020-04-21 05:15:15',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(531,2,'/audio/stetho_sounds/531.wav',0,'成育040_右側胸部','Lesson S2\n\n',2,'右側胸部','S1>S2\n',0,1,'左末梢性肺動脈狭窄','-','35週2日，2234gで出生した児．日齢6での録音．機能性雑音または左末梢性肺動脈狭窄の音．','Normal heart sound (S1 + S2) at the tricuspid and mitral regions, S1 > S2 is audible.\n\n','症例23：35週2日，2234gで出生した児','',3,0,404,'2019-10-28 04:49:00','2019-10-28 04:49:00','2020-04-03 06:08:57',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(532,2,'/audio/stetho_sounds/532.mp3',0,NULL,'Stepwise lesson-6',2,NULL,'P',1,1,NULL,'-',NULL,'                                    During inspiration, S2 split is heard which is caused by a slight delay in closing the pulmonary valve than aortic valve due to increased blood flow through PA.    Normal heart sound (5 beats) + splitted S2 (5 beats)\r\n            \r\n   