unds-6',9,NULL,'-',1,1,NULL,'Blood pressure exam',NULL,'                                                A Korotkoff sounds are made in the blood stream when an artery in the upper arm is compressed with a cuff to block the artery, followed by decompression. / The 1st point is that the sound synchronized with the heartbeat begins to sounds (systolic blood pressure) / phase perceived as noise with decompression (Phase 2), phase with louder sound (Phase 3), phase with steeply weaker sound (Phase 2), phase with deafness changed to point 5 (diastolic blood pressure).       \r\n            \r\n            \r\n            \r\n            ','PR 84 bpm',NULL,2,1,19,'2020-04-07 17:11:34','2020-04-21 05:22:05',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(560,2,'/audio/stetho_sounds/560.mp3',0,NULL,'Arteriovenous shunt-1',9,NULL,'Arteriovenous shunt area',1,1,NULL,'Hemodialysis',NULL,'                                                                                                                                                Murmur caused by the flow of blood from an artery into a vein. / Confirm the condition of the shunt by listening to several places.\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','Continuous murmur 1',NULL,2,1,17,'2020-04-08 15:57:29','2020-04-21 05:22:19',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(561,2,'/audio/stetho_sounds/561.mp3',0,NULL,'Arteriovenous shunt-4',9,NULL,'Arteriovenous shunt area',1,0,NULL,'Hemodialysis',NULL,'                                                                                                                        Shunt sounds are intermittent when obstruction occurs. / Murmur caused by the flow of blood from an artery into a vein. / Confirm the condition of the shunt by listening to several places.\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','Intermittent murmur',NULL,2,1,14,'2