stetho_sounds/565.mp3',0,NULL,'Stepwise lesson-3',2,NULL,'T and M',1,1,NULL,'-',NULL,'                        Normal heart sound (S1 + S2) at the tricuspid and mitral area, S1 > S2 is audible.     \r\nMono heart sound (5 beats) + S1 > S2 (5 beats)\r\n\r\n            \r\n            ','S1 > S2',NULL,2,1,65,'2020-04-15 15:11:04','2020-04-21 05:14:38',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(566,2,'/audio/stetho_sounds/566.mp3',0,NULL,'Stepwise lesson-13',2,NULL,'T',1,0,NULL,'Aortic regargitation (AR)',NULL,'                                                                                     Systolic ejection murmur (AS) and decrescendo murmur from early diastole (AR)  are heard. \r\nMiddle systolic murmur (5 beats) + MidSysMur & early diastolic murmur (5 beats)\r\n            \r\n            \r\n            \r\n            \r\n            \r\n            \r\n            ','Early diastolic murmur/AR',NULL,2,1,55,'2020-04-15 15:46:08','2020-04-21 05:16:15',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(567,2,'/audio/stetho_sounds/567.mp3',0,NULL,'Lung sounds-21',1,NULL,'Neck',1,1,NULL,'-',NULL,'                                    Tracheal sounds with heart sounds (S1 < S2) / \r\nTracheal breath sounds are broad frequencies heard over the trachea, sometimes as high as 1000 Hz. The duration of inspiratory (Insp) vs expiratory (Exp) phase is 1: 1, although Exp phase might be longer than that of Insp. The frequency ranges between 200 Hz to 2000 Hz.\r\n            \r\n            \r\n            \r\n            ','Tracheal+Heart(S1<S2)',NULL,2,1,33,'2020-04-16 18:31:25','2020-04-21 05:19:56',NULL,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(568,2,'/audio/stetho_sounds/568.mp3',0,NULL,'Lung sounds-22',1,NULL,'Upper and middle lung area',1,1,NULL,'-',NULL,'                                                            Bronchial sounds with heart sounds (S1 < S2) / \r\nSounds heard around the carina at the level of Lewis angle with intermedia